INSERT INTO `ps_cms_lang` VALUES (1,1,1,'Monsteriada.pl - Kim jesteśmy','','','','<h2 style=\"margin-top:0px;margin-bottom:0.5rem;font-family:Sen, sans-serif;line-height:1.1;color:#666666;font-size:1.25rem;letter-spacing:-0.32px;text-align:justify;\">Kim jesteśmy</h2>\r\n<p style=\"margin-top:0px;margin-bottom:16px;font-size:16px;color:#666666;line-height:30px;font-family:Sen, sans-serif;letter-spacing:-0.32px;text-align:justify;\"><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">Podobno największy sukces można osiągnąć, jeśli biznes prowadzony jest z prawdziwej pasji. </span></span><span style=\"font-weight:bolder;\">Sklep internetowy Monsteriada.pl</span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\"> założyliśmy jako pasjonaci i fani, którzy chcieli stworzyć miejsce dla takich ludzi jak my. Ludzi, którzy chcą poszerzać swoje kolekcje o najnowsze gadżety Star Wars, figurki Wiedźmina czy repliki z Władcy Pierścieni i setek innych tytułów. To również sklep dla wszystkich tych, którzy szukają wyjątkowych, spersonalizowanych </span></span><span style=\"font-weight:bolder;\">pomysłów na prezent</span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\"> dla ukochanego geeka.</span></span></p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;font-size:16px;color:#666666;line-height:30px;font-family:Sen, sans-serif;letter-spacing:-0.32px;text-align:justify;\"><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">W branży działamy od 2009 roku. Kiedy zakładaliśmy naszą firmę polscy fani mieli ograniczony dostęp do </span></span><span style=\"font-weight:bolder;\">licencjonowanych gadżetów</span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">, a większość produktów trzeba było sprowadzać z zza granicy. Dziś możemy z dumą stwierdzić, że udało nam się stworzyć platformę, na której można znaleźć nawet najbardziej poszukiwane </span></span><span style=\"font-weight:bolder;\">produkty kolekcjonerskie</span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\"> w tematyce: Hobbit i Władca Pierścieni, Jurassic Park oraz Jurassic World, Harry Potter oraz Fantastyczne Zwierzęta, Batman, Star Wars, Marvel, DC Comics, Mortal Kombat, Alien i Predator, Pokemon, Dragon Ball, Disney, Wiedźmin, Super Mario, Transformers i wiele innych. Tak też w 2021 roku powstał nowy, dedykowany sklep dla geeków, nerdów i kolekcjonerów - </span></span><a href=\"https://monsteriada.pl/\" style=\"background-color:transparent;\">Monsteriada.pl</a><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">. W naszej ofercie nie ma jednak miejsca na ograniczenia. Zawsze wsłuchujemy się w prośby naszych Klientów – poruszymy niebo i ziemię, by znaleźć wymarzony artefakt.</span></span></p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;font-size:16px;color:#666666;line-height:30px;font-family:Sen, sans-serif;letter-spacing:-0.32px;text-align:justify;\"><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">Współpracujemy z takimi gigantami na rynku producentów, jak </span></span><span style=\"color:#666666;font-family:Sen, sans-serif;font-size:16px;letter-spacing:-0.32px;\">Noble Collection</span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">, </span></span><span style=\"color:#666666;font-family:Sen, sans-serif;font-size:16px;letter-spacing:-0.32px;\">Cinereplicas</span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">, </span></span><span style=\"color:#666666;font-family:Sen, sans-serif;font-size:16px;letter-spacing:-0.32px;\">Sideshow</span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">, </span></span><span style=\"color:#666666;font-family:Sen, sans-serif;font-size:16px;letter-spacing:-0.32px;\">Prime 1 Studio</span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">, </span></span><span style=\"color:#666666;font-family:Sen, sans-serif;font-size:16px;letter-spacing:-0.32px;\">NECA</span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">, </span></span><span style=\"color:#666666;font-family:Sen, sans-serif;font-size:16px;letter-spacing:-0.32px;\">McFarlane</span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">, </span></span><span style=\"color:#666666;font-family:Sen, sans-serif;font-size:16px;letter-spacing:-0.32px;\">AbyStyle</span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">, </span></span><span style=\"color:#666666;font-family:Sen, sans-serif;font-size:16px;letter-spacing:-0.32px;\">Paladone</span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">, </span></span><span style=\"color:#666666;font-family:Sen, sans-serif;font-size:16px;letter-spacing:-0.32px;\">United Cutlery</span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">, </span></span><span style=\"color:#666666;font-family:Sen, sans-serif;font-size:16px;letter-spacing:-0.32px;\">GBEye</span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\"> i wieloma innymi dostawcami, oferujących swoje produkty na oficjalnych licencjach. Zaczynaliśmy głównie w sprzedaży replik i unikatowych gadżetów, a z czasem rozszerzyliśmy naszą działalność o popularne figurki kolekcjonerskie dostępne w każdej możliwej skali</span></span></p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;font-size:16px;color:#666666;line-height:30px;font-family:Sen, sans-serif;letter-spacing:-0.32px;text-align:justify;\">Jeśli tak jak my jesteś miłośnikiem gier, książek, komiksów i kultowych filmów, wybierz się z nami w podróż po krainie <span style=\"font-weight:bolder;\">Monsteriady</span>. Twoimi przewodnikami będą nasze trzy stworki…, które zabiorą Cię w pasjonujący quest, w którym nagrodą będzie Twój wymarzony produkt fanowski.</p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;font-size:16px;color:#666666;line-height:30px;font-family:Sen, sans-serif;letter-spacing:-0.32px;text-align:justify;\"><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">Czego poszukujesz? </span></span><span style=\"font-weight:bolder;\"><span>Doskonałych okazji cenowych</span>, <span>gorących nowości w przedsprzedaży</span></span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">, a może </span></span><span style=\"color:#666666;font-family:Sen, sans-serif;font-size:16px;letter-spacing:-0.32px;\"><span style=\"font-weight:bolder;\">bestsellerowych produktów</span></span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">? Intuicyjny podział na kategorie i tematyki pozwolą Ci szybko znaleźć dany </span></span><span style=\"font-weight:bolder;\">gadżet</span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">. W ofercie mamy statuy kolekcjonerskie w imponujących wielkościach oraz figurki dla pasjonatów. Na spotkania towarzyskie oraz rodzinne weekendy polecamy gry i zabawki, w tym zestawy puzzli i klocków LEGO®. Jeśli chcesz na co dzień pokazać swoją przynależność do fandomu, wybierz ubrania i akcesoria na oficjalnych licencjach. A może szukasz prezentu? Tematyczne akcesoria do domu dostarczą Ci najlepszych pomysłów! W ofercie znajdują się kubki, lampki, wycieraczki i mnóstwo innych </span></span><span style=\"font-weight:bolder;\">gadżetów</span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">. A na wyjątkowe okazje czekają na </span></span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">Ciebie repliki i kostiumy dostępne nie tylko dla fanów </span></span><span style=\"font-weight:bolder;\">cosplay</span><span style=\"color:#666666;font-family:Sen, sans-serif;\"><span style=\"font-size:16px;letter-spacing:-0.32px;\">.</span></span></p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;font-size:16px;color:#666666;line-height:30px;font-family:Sen, sans-serif;letter-spacing:-0.32px;text-align:justify;\">Czujesz niedosyt? Spokojnie, dopiero się rozkręcamy! Zaglądaj do nas regularnie, by zapolować na limitowane edycje i <span style=\"font-weight:bolder;\">nowości na rynku</span>. Jesteśmy na bieżąco z trendami i bez przerwy uzupełniamy nasz asortyment o kolejne produkty.</p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;font-size:16px;color:#666666;line-height:30px;font-family:Sen, sans-serif;letter-spacing:-0.32px;text-align:justify;\">Jeżeli chcesz się z nami spotkać, bądź odebrać zamówienie osobiście, zapraszamy do naszego punktu odbioru na warszawskim Mokotowie :)</p>','monsteriadapl-kim-jestesmy'),(2,1,1,'Regulamin sklepu','','','','<h1 style=\"font-size:36px;margin:0px;font-family:inherit;font-weight:bold;line-height:1.1;padding:0px 0px 30px;text-transform:none;\">Regulamin</h1>\r\n\r\n<div class=\"container\" style=\"margin-left:auto;margin-right:auto;padding-left:15px;padding-right:15px;width:1390px;max-width:100%;\">\r\n<div class=\"colrow row\" style=\"margin-right:-15px;margin-left:-15px;\">\r\n<div id=\"content-wrapper\" class=\"col-xs-12\" style=\"min-height:1px;padding-right:15px;padding-left:15px;float:none;width:auto;max-width:100%;\">\r\n\r\n\r\n<p class=\"Domylnie\" align=\"right\" style=\"margin-top:0px;margin-bottom:16px;line-height:30px;text-align:left;\"><i>REGULAMIN SKLEPU INTERNETOWEGO<br /><br />1. Niniejszy Regulamin określa ogólne warunki, zasady oraz sposób sprzedaży prowadzonej przez Jakuba Kuszyńskiego prowadzącego działalność gospodarczą pod firmą Network Lab Jakub Kuszyński z siedzibą w Warszawie za pośrednictwem sklepu internetowego <a href=\"https://monsteriada.pl/\" style=\"background-color:transparent;\">monsteriada.pl</a> (zwanego dalej: „Sklepem Internetowym”) oraz określa zasady i warunki świadczenia przez Jakuba Kuszyńskiego prowadzącego działalność gospodarczą pod firmą Network Lab Jakub Kuszyński z siedzibą w Warszawie usług nieodpłatnych drogą elektroniczną.<br /><br />§ 1 Definicje<br />1. Dni robocze - oznacza dni tygodnia od poniedziałku do piątku z wyłączeniem dni ustawowo wolnych od pracy.<br />2. Dostawa - oznacza czynność faktyczną polegającą na dostarczeniu Klientowi przez Sprzedawcę, za pośrednictwem Dostawcy, Towaru określonego w zamówieniu.<br />3. Dostawca - oznacza podmiot, z którym współpracuje Sprzedawca w zakresie dokonywania Dostawy Towarów: a) firmę kurierską; b) InPost Sp. z o.o. z siedzibą w Krakowie, świadcząca usługi Dostawy i obsługi systemu skrytek pocztowych (Paczkomat).<br />4. Hasło - oznacza ciąg znaków literowych, cyfrowych lub innych wybranych przez Klienta podczas Rejestracji w Sklepie Internetowym, wykorzystywanych w celu zabezpieczenia dostępu do Konta Klienta w Sklepie Internetowym.<br />5. Klient - oznacza podmiot, na rzecz którego zgodnie z Regulaminem i przepisami prawa mogą być świadczone usługi drogą elektroniczną lub z którym zawarta może być Umowa sprzedaży.<br />6. Konsument - oznacza osobę fizyczną dokonującą z przedsiębiorcą czynności prawnej niezwiązanej bezpośrednio z jej działalnością gospodarczą lub zawodową.<br />7. Konto Klienta - oznacza indywidualny dla każdego Klienta panel, uruchomiony na jego rzecz przez Sprzedawcę, po dokonaniu przez Klienta Rejestracji i zawarciu umowy świadczenia usługi Prowadzenie Konta Klienta.<br />8. Przedsiębiorca - oznacza osobę fizyczną, osobę prawną lub jednostkę organizacyjną niebędącą osobą prawną, której ustawa przyznaje zdolność prawną, prowadzącą we własnym imieniu działalność gospodarczą lub zawodową i dokonującą czynności prawnej związanej bezpośrednio z jej działalnością gospodarczą lub zawodową.<br />9. Przedsiębiorca z uprawnieniami Konsumenta - oznacza osobę fizyczną zawierającą Umowę sprzedaży bezpośrednio związaną z jej działalnością gospodarczą, gdy z treści Umowy sprzedaży wynika, że nie posiada ona dla tego Przedsiębiorcy zawodowego charakteru, wynikającego w szczególności z przedmiotu wykonywanej przez niego działalności gospodarczej, udostępnionego na podstawie przepisów o Centralnej Ewidencji i Informacji o Działalności Gospodarczej.<br />10. Regulamin - oznacza niniejszy regulamin.<br />11. Rejestracja - oznacza czynność faktyczną dokonaną w sposób określony w Regulaminie, wymaganą dla korzystania przez Klienta ze wszystkich funkcjonalności Sklepu Internetowego.<br />12. Sprzedawca - oznacza Jakuba Kuszyńskiego prowadzącego działalność gospodarczą pod firmą Network Lab Jakub Kuszyński z siedzibą w Warszawie (04-348), ul. Garwolińska 9/95, NIP: 1132576111, REGON: 142108492, wpisaną do Centralnej Ewidencji i Informacji o Działalności Gospodarczej prowadzonej przez Ministra Rozwoju i Technologii; e-mail: kontakt@monsteriada.pl, będącego jednocześnie właścicielem Sklepu Internetowego. Numer BDO - 000257861.<br />13. Strona Internetowa Sklepu - oznacza strony internetowe, pod którymi Sprzedawca prowadzi Sklep Internetowy, działające w domenie <a href=\"https://monsteriada.pl/\" style=\"background-color:transparent;\">monsteriada.pl</a>.<br />14. Towar - oznacza produkt przedstawiony przez Sprzedawcę za pośrednictwem Strony Internetowej Sklepu, mogący być przedmiotem Umowy sprzedaży.<br />15. Trwałość - zdolność Towaru do zachowania jego funkcji i właściwości w toku zwykłego korzystania.<br />16. Trwały nośnik - oznacza materiał lub narzędzie umożliwiające Klientowi lub Sprzedawcy przechowywanie informacji kierowanych osobiście do niego, w sposób umożliwiający dostęp do informacji w przyszłości przez czas odpowiedni do celów, jakim te informacje służą, i które pozwalają na odtworzenie przechowywanych informacji w niezmienionej postaci.<br />17. Umowa sprzedaży - oznacza umowę sprzedaży zawartą na odległość, na zasadach określonych w Regulaminie, między Klientem a Sprzedawcą.<br /><br />§ 2 Postanowienia ogólne i korzystanie ze Sklepu Internetowego<br />1. Wszelkie prawa do Sklepu Internetowego, w tym majątkowe prawa autorskie, prawa własności intelektualnej do jego nazwy, jego domeny internetowej, Strony Internetowej Sklepu, a także do wzorców, formularzy, logotypów zamieszczanych na Stronie Internetowej Sklepu (z wyjątkiem logotypów i zdjęć prezentowanych na Stronie Internetowej Sklepu w celach prezentacji towarów, do których to prawa autorskie należą do podmiotów trzecich) należą do Sprzedawcy, a korzystanie z nich może następować wyłącznie w sposób określony i zgodny z Regulaminem oraz za zgodą Sprzedawcy wyrażoną na piśmie.<br />2. Sprzedawca dołoży starań, aby korzystanie ze Sklepu Internetowego było możliwe dla użytkowników Internetu z użyciem wszystkich popularnych przeglądarek internetowych, systemów operacyjnych, typów urządzeń oraz typów połączeń internetowych. Minimalne wymagania techniczne umożliwiające korzystanie ze Strony Internetowej Sklepu to przeglądarka internetowa w wersji co najmniej Microsoft Edge 109 lub Internet Explorer 11 lub Chrome 110 lub FireFox 109 lub Opera 95 lub Safari 11 lub nowszych, z włączoną obsługą języka Javascript, akceptująca pliki typu „cookies” oraz łącze internetowe o przepustowości co najmniej 256 kbit/s. Strona Internetowa Sklepu jest zoptymalizowana dla minimalnej rozdzielczości ekranu 1024x768 pikseli.<br />3. Sprzedawca stosuje mechanizm plików \"cookies\", które podczas korzystania przez Klientów ze Strony Internetowej Sklepu, zapisywane są przez serwer Sprzedawcy na dysku twardym urządzenia końcowego Klienta. Stosowanie plików \"cookies\" ma na celu poprawne działanie Strony Internetowej Sklepu na urządzeniach końcowych Klientów. Mechanizm ten nie niszczy urządzenia końcowego Klienta oraz nie powoduje zmian konfiguracyjnych w urządzeniach końcowych Klientów ani w oprogramowaniu zainstalowanym na tych urządzeniach. Każdy Klient może wyłączyć mechanizm „cookies” w przeglądarce internetowej swojego urządzenia końcowego. Sprzedawca wskazuje, że wyłączenie „cookies” może jednak spowodować utrudnienia lub uniemożliwić korzystanie ze Strony Internetowej Sklepu.<br />4. W celu złożenia zamówienia w Sklepie Internetowym za pośrednictwem Strony Internetowej Sklepu oraz w celu korzystania z usług świadczonych drogą elektroniczną za pośrednictwem Strony Internetowej Sklepu, konieczne jest posiadanie przez Klienta aktywnego konta poczty elektronicznej.<br />5. Zakazane jest dostarczanie przez Klienta treści o charakterze bezprawnym oraz wykorzystywanie przez Klienta Sklepu Internetowego, Strony Internetowej Sklepu lub usług nieodpłatnych świadczonych przez Sprzedawcę, w sposób sprzeczny z prawem, dobrymi obyczajami lub naruszający dobra osobiste osób trzecich.<br />6. Sprzedawca oświadcza, iż publiczny charakter sieci Internet i korzystanie z usług świadczonych drogą elektroniczną wiązać może się z zagrożeniem pozyskania i modyfikowania danych Klientów przez osoby nieuprawnione, dlatego Klienci powinni stosować właściwe środki techniczne, które zminimalizują wskazane wyżej zagrożenia. W szczególności powinni stosować programy antywirusowe i chroniące tożsamość korzystających z sieci Internet. Sprzedawca nigdy nie zwraca się do Klienta z prośbą o udostępnienie mu w jakiejkolwiek formie Hasła.<br />7. Nie jest dopuszczalne wykorzystywanie zasobów i funkcji Sklepu Internetowego w celu prowadzenia przez Klienta działalności, która naruszałaby interes Sprzedawcy, tj. działalności reklamowej innego przedsiębiorcy lub produktu; działalności polegającej na zamieszczaniu treści niezwiązanych z działalnością Sprzedawcy; działalności polegającej na zamieszczaniu treści nieprawdziwych lub wprowadzających w błąd.<br /><br />§ 3 Rejestracja<br />1. W celu utworzenia Konta Klienta, Klient obowiązany jest dokonać nieodpłatnej Rejestracji.<br />2. Rejestracja nie jest konieczna do złożenia zamówienia w Sklepie Internetowym.<br />3. W celu Rejestracji, Klient powinien wypełnić formularz rejestracyjny udostępniony przez Sprzedawcę na Stronie Internetowej Sklepu i przesłać wypełniony formularz rejestracyjny drogą elektroniczną do Sprzedawcy poprzez wybór odpowiedniej funkcji znajdującej się w formularzu rejestracyjnym. Podczas Rejestracji Klient ustala indywidualne Hasło.<br />4. W trakcie wypełniania formularza rejestracyjnego, Klient ma możliwość zapoznania się z Regulaminem, akceptując jego treść poprzez oznaczenie odpowiedniego pola w formularzu.<br />5. Po przesłaniu wypełnionego formularza rejestracyjnego Klient otrzymuje niezwłocznie, drogą elektroniczną na adres poczty elektronicznej podany w formularzu rejestracyjnym potwierdzenie Rejestracji przez Sprzedawcę. Z tą chwilą zawarta zostaje umowa o świadczenie drogą elektroniczną usługi Prowadzenie Konta Klienta, zaś Klient uzyskuje możliwość dostępu do Konta Klienta i dokonywania zmian podanych podczas Rejestracji danych.<br /><br />§ 4 Zamówienia<br />1. Informacje zawarte na Stronie Internetowej Sklepu nie stanowią oferty Sprzedawcy w rozumieniu Kodeksu Cywilnego, a jedynie zaproszenie Klientów do składania ofert zawarcia Umowy sprzedaży.<br />2. Klient może składać zamówienia w Sklepie Internetowym za pośrednictwem Strony Internetowej Sklepu przez 7 dni w tygodniu, 24 godziny na dobę.<br />3. Klient składający zamówienie za pośrednictwem Strony Internetowej Sklepu, kompletuje zamówienie wybierając Towar, którym jest zainteresowany. Dodanie Towaru do zamówienia następuje przez wybór polecenia DO KOSZYKA pod danym Towarem prezentowanym na Stronie Internetowej Sklepu. Klient po skompletowaniu całości zamówienia i wskazaniu w „KOSZYKU” sposobu Dostawy oraz formy płatności składa zamówienie przez wysłanie formularza zamówienia do Sprzedawcy, wybierając na Stronie Internetowej Sklepu przycisk „Zamawiam i płacę”. Każdorazowo przed wysyłką zamówienia do Sprzedawcy, Klient jest informowany o łącznej cenie za wybrany Towar i Dostawę, jak też o wszystkich dodatkowych kosztach, jakie jest zobowiązany ponieść w związku z Umową sprzedaży.<br />4. Złożenie zamówienia stanowi złożenie Sprzedawcy przez Klienta oferty zawarcia Umowy sprzedaży Towarów będących przedmiotem zamówienia.<br />5. Po złożeniu zamówienia, Sprzedawca przesyła na podany przez Klienta adres poczty elektronicznej potwierdzenie jego złożenia.<br />6. Następnie, po potwierdzeniu złożenia zamówienia, Sprzedawca przesyła na podany przez Klienta adres poczty elektronicznej informację o przyjęciu zamówienia do realizacji. Informacja o przyjęciu zamówienia do realizacji jest oświadczeniem Sprzedawcy o przyjęciu oferty, o której mowa w §4 ust. 4 powyżej i z chwilą jego otrzymania przez Klienta zostaje zawarta Umowa sprzedaży.<br />7. Po zawarciu Umowy sprzedaży, Sprzedawca potwierdza Klientowi jej warunki, przesyłając je na Trwałym nośniku, na adres poczty elektronicznej Klienta lub pisemnie na wskazany przez Klienta, podczas Rejestracji lub składania zamówienia adres.<br /><br />§ 5 Płatności<br />1. Ceny na Stronie Internetowej Sklepu zamieszczone przy danym Towarze stanowią ceny brutto i nie zawierają informacji odnośnie kosztów Dostawy i wszelkich innych kosztów, które Klient będzie zobowiązany ponieść w związku z Umową sprzedaży, o których Klient będzie poinformowany przy wyborze sposobu Dostawy i składaniu zamówienia.<br />2. Klient może wybrać następujące formy płatności za zamówione Towary:<br />a) przelew bankowy na rachunek bankowy Sprzedawcy (w tym przypadku realizacja zamówienia rozpoczęta zostanie po przesłaniu Klientowi przez Sprzedawcę potwierdzenia przyjęcia zamówienia oraz po wpłynięciu środków na rachunek bankowy Sprzedawcy);<br />b) przelew bankowy na rachunek bankowy Sprzedawcy z opcją odbioru osobistego w biurze Sprzedawcy (w tym przypadku realizacja zamówienia zostanie rozpoczęta niezwłocznie po przesłaniu Klientowi przez Sprzedawcę potwierdzenia przyjęcia zamówienia, zaś Towar wydany zostanie w biurze Sprzedawcy, po wpłynięciu środków na rachunek bankowy Sprzedawcy);<br />c) karta płatnicza lub przelew bankowy poprzez zewnętrzny system płatności PayU, obsługiwany przez firmę PayU S.A. z siedzibą w Poznaniu (w tym przypadku realizacja zamówienia rozpoczęta zostanie po przesłaniu Klientowi przez Sprzedawcę potwierdzenia przyjęcia zamówienia oraz po otrzymaniu z systemu PayU informacji o pozytywnym zakończeniu przeprowadzonej płatności);<br />d) gotówką za pobraniem, płatność Dostawcy przy dokonywaniu Dostawy (w tym przypadku realizacja zamówienia zostanie rozpoczęta po przesłaniu Klientowi przez Sprzedawcę potwierdzenia przyjęcia zamówienia);<br />e) gotówką przy odbiorze osobistym – płatność w biurze Sprzedawcy (w tym przypadku realizacja zamówienia zostanie dokonana niezwłocznie po przesłaniu Klientowi przez Sprzedawcę potwierdzenia przyjęcia zamówienia, zaś Towar wydany zostanie w biurze Sprzedawcy).<br />3. Klient powinien dokonać płatności za zamówienie w wysokości wynikającej z zawartej Umowy sprzedaży w terminie 7 Dni roboczych, jeżeli wybrał formę przedpłaty.<br />4. W wypadku niewywiązania się przez Klienta z płatności w terminie, o którym mowa w §5 ust. 3 Regulaminu, Sprzedawca wyznacza Klientowi dodatkowy termin na dokonanie płatności i informuje o nim Klienta na Trwałym nośniku. Informacja o dodatkowym terminie na dokonanie płatności zawiera również informację, że po bezskutecznym upływie tego terminu, Sprzedawca odstąpi od Umowy sprzedaży. W wypadku bezskutecznego upływu drugiego terminu na dokonanie płatności, Sprzedawca prześle Klientowi na Trwałym nośniku oświadczenie o odstąpieniu od umowy na podstawie art. 491 Kodeksu Cywilnego.<br /><br />§ 6 Dostawa<br />1. Sprzedawca realizuje Dostawę na terytorium Rzeczypospolitej Polskiej.<br />2. Sprzedawca jest zobowiązany dostarczyć Towar zgodny z Umową sprzedaży.<br />3. Sprzedawca zamieszcza na Stronie Internetowej Sklepu informację o liczbie Dni roboczych potrzebnych do Dostawy i realizacji zamówienia.<br />4. Termin Dostawy i realizacji zamówienia wskazany na Stronie Internetowej Sklepu liczony jest w Dniach roboczych zgodnie z §5 ust. 2 Regulaminu.<br />5. Zamówione Towary są dostarczane do Klienta za pośrednictwem Dostawcy na adres wskazany w formularzu zamówienia.<br />W przypadku wyboru InPost Sp. z o.o. z siedzibą w Krakowie jako Dostawcy, adresem Dostawy będzie adres paczkomatu wybranego przez Klienta w momencie składania zamówienia.<br />6. W dniu wysłania Towaru do Klienta (jeśli nie wybrano możliwości osobistego odbioru Towaru) przekazywana jest na adres poczty elektronicznej Klienta informacja potwierdzająca nadanie przesyłki przez Sprzedawcę.<br />7. Klient obowiązany jest zbadać doręczoną przesyłkę w czasie i w sposób przyjęty przy przesyłkach danego rodzaju. W razie stwierdzenia ubytku lub uszkodzenia przesyłki Klient ma prawo żądać od pracownika Dostawcy spisania właściwego protokołu.<br />8. Klient ma możliwość odbioru osobistego zamówionego Towaru. Odbioru można dokonać w biurze Sprzedawcy w Dni Robocze, w godzinach otwarcia wskazanych na Stronie Internetowej Sklepu, po wcześniejszym ustaleniu ze Sprzedawcą terminu odbioru za pośrednictwem poczty elektronicznej lub telefonicznie.<br />9. Sprzedawca, zgodnie z wolą Klienta, dołącza do przesyłki będącej przedmiotem Dostawy paragon albo fakturę VAT obejmującą dostarczane Towary.<br />Klient w celu otrzymania faktury VAT powinien zadeklarować w momencie dokonywania zakupu, że nabywa Towar jako Przedsiębiorca (podatnik). Zgłoszenie powyższej deklaracji następuje poprzez oznaczenie odpowiedniego pola w formularzu zamówienia, przed wysłaniem zamówienia do Sprzedawcy.<br />10. W przypadku nieobecności Klienta pod wskazanym przez niego adresem, podanym przy składaniu zamówienia jako adres Dostawy, pracownik Dostawcy pozostawi awizo lub podejmie próbę kontaktu telefonicznego celem ustalenia terminu, w którym Klient będzie obecny. W przypadku zwrotnego odesłania zamówionego Towaru do Sklepu Internetowego przez Dostawcę, Sprzedawca skontaktuje się z Klientem drogą elektroniczną lub telefonicznie, ustalając ponownie z Klientem termin i koszt Dostawy.<br /><br />§ 7 Rękojmia dla Przedsiębiorców<br />1. Sprzedawca zapewnia Dostawę Towaru pozbawionego wad. Sprzedawca jest odpowiedzialny względem Przedsiębiorcy, jeżeli Towar ma wadę.<br />2. Jeżeli Towar ma wadę, Przedsiębiorca może:<br />a) złożyć oświadczenie o obniżeniu ceny albo odstąpieniu od Umowy sprzedaży, chyba że Sprzedawca niezwłocznie i bez nadmiernych niedogodności dla Przedsiębiorcy wymieni Towar wadliwy na wolny od wad albo wadę usunie.<br />Ograniczenie to nie ma zastosowania, jeżeli Towar był już wymieniony lub naprawiany przez Sprzedawcę albo Sprzedawca nie uczynił zadość obowiązkowi wymiany Towaru na wolny od wad lub usunięcia wad. Przedsiębiorca może zamiast zaproponowanego przez Sprzedawcę usunięcia wady żądać wymiany Towaru na wolny od wad albo zamiast wymiany Towaru żądać usunięcia wady, chyba że doprowadzenie rzeczy do zgodności z umową w sposób wybrany przez Przedsiębiorcę jest niemożliwe albo wymagałoby nadmiernych kosztów w porównaniu ze sposobem proponowanym przez Sprzedawcę. Przy ocenie nadmierności kosztów uwzględnia się wartość Towaru wolnego od wad, rodzaj i znaczenie stwierdzonej wady, a także bierze się pod uwagę niedogodności, na jakie narażałby Przedsiębiorcę inny sposób zaspokojenia.<br />Przedsiębiorca nie może odstąpić od Umowy sprzedaży, jeżeli wada jest nieistotna.<br />b) żądać wymiany Towaru wadliwego na wolny od wad albo usunięcia wady. Sprzedawca jest obowiązany wymienić Towar wadliwy na wolny od wad lub usunąć wadę w rozsądnym czasie bez nadmiernych niedogodności dla Przedsiębiorcy.<br />Sprzedawca może odmówić zadośćuczynienia żądaniu Przedsiębiorcy, jeżeli doprowadzenie do zgodności z Umową sprzedaży Towaru wadliwego w sposób wybrany przez Przedsiębiorcę jest niemożliwe lub w porównaniu z drugim możliwym sposobem doprowadzenia do zgodności z Umową sprzedaży wymagałoby nadmiernych kosztów. Koszty naprawy lub wymiany ponosi Sprzedawca.<br />3. Sprzedawca odpowiada z tytułu rękojmi, jeżeli wada fizyczna zostanie stwierdzona przed upływem dwóch lat od wydania Towaru Przedsiębiorcy. Roszczenie o usunięcie wady lub wymianę Towaru na wolny od wad przedawnia się z upływem roku, lecz termin ten nie może zakończyć się przed upływem terminu określonego w zdaniu pierwszym. W tym terminie Przedsiębiorca może odstąpić od Umowy sprzedaży lub złożyć oświadczenie o obniżeniu ceny z powodu wady Towaru. Jeżeli Przedsiębiorca żądał wymiany Towaru na wolny od wad lub usunięcia wady, termin do odstąpienia od Umowy sprzedaży lub złożenia oświadczenia o obniżeniu ceny rozpoczyna się z chwilą bezskutecznego upływu terminu do wymiany Towaru, lub usunięcia wady<br />4. Przedsiębiorca, który wykonuje uprawnienia z tytułu rękojmi, jest obowiązany dostarczyć rzecz wadliwą na adres Sprzedawcy. Koszt dostarczenia pokrywa Sprzedawca.<br />5. Wszelkie reklamacje związane z Towarem lub realizacją Umowy sprzedaży, Przedsiębiorca może kierować w formie pisemnej na adres Sprzedawcy<br />6. Sprzedawca w ciągu 14 dni od dnia żądania zawierającego reklamację, ustosunkuje się do reklamacji Towaru lub reklamacji związanej z realizacją Umowy sprzedaży zgłoszonej przez Przedsiębiorcę.<br /><br />§ 8 Niezgodność towaru z umową<br />Reklamacja Konsumenta oraz Przedsiębiorcy z uprawnieniami Konsumenta<br />1. Towar jest zgodny z umową, jeżeli zgodne z umową pozostają w szczególności jego:<br />a) opis, rodzaj, ilość, jakość, kompletność i funkcjonalność, a w odniesieniu do towarów z elementami cyfrowymi – również kompatybilność, interoperacyjność i dostępność aktualizacji;<br />b) przydatność do szczególnego celu, do którego jest potrzebny Konsumentowi lub Przedsiębiorcy z uprawnieniami Konsumenta, o którym Konsument lub Przedsiębiorca z uprawnieniami Konsumenta, powiadomił Sprzedawcę najpóźniej w chwili zawarcia umowy i który Sprzedawca zaakceptował.<br />2. Ponadto Towar, aby został uznany za zgodny z umową, musi:<br />a) nadawać się do celów, do których zazwyczaj używa się Towaru tego rodzaju, z uwzględnieniem obowiązujących przepisów prawa, norm technicznych lub dobrych praktyk;<br />b) występować w takiej ilości i mieć takie cechy, w tym Trwałość i bezpieczeństwo, a w odniesieniu do Towarów z elementami cyfrowymi – również funkcjonalność i kompatybilność, jakie są typowe dla Towaru tego rodzaju i których Konsument lub Przedsiębiorca z uprawnieniami Konsumenta może rozsądnie oczekiwać, biorąc pod uwagę charakter Towaru oraz publiczne zapewnienie złożone przez Sprzedawcę, jego poprzedników prawnych lub osoby działające w ich imieniu, w szczególności w reklamie lub na etykiecie, chyba że Sprzedawca wykaże, że:<br />a. nie wiedział o danym publicznym zapewnieniu i oceniając rozsądnie, nie mógł o nim wiedzieć;<br />b. przed zawarciem umowy publicznej zapewnienie zostało sprostowane z zachowaniem warunków i formy, w jakich publiczne zapewnienie zostało złożone, lub w porównywalny sposób;<br />c. publiczne zapewnienie nie miało wpływu na decyzję Konsumenta lub Przedsiębiorcy z uprawnieniami Konsumenta o zawarciu umowy.<br />d. być dostarczany z opakowaniem, akcesoriami i instrukcjami, których dostarczenia Konsument lub Przedsiębiorca z uprawnieniami Konsumenta może rozsądnie oczekiwać;<br />e. być takiej samej jakości jak próbka lub wzór, które Sprzedawca udostępnił Konsumentowi lub Przedsiębiorcy z uprawnieniami Konsumenta przed zawarciem umowy, i odpowiadać opisowi takiej próbki lub takiego wzoru.<br />3. Sprzedawca nie ponosi odpowiedzialności za brak zgodności Towaru z umową w zakresie, o którym mowa w §8 ust. 2, jeżeli Konsument lub Przedsiębiorca z uprawnieniami Konsumenta, najpóźniej w chwili zawarcia umowy, został wyraźnie poinformowany, że konkretna cecha Towaru odbiega od wymogów zgodności z umową określonych w §8 ust. 2, oraz wyraźnie i odrębnie zaakceptował brak konkretnej cechy Towaru.<br />4. Sprzedawca ponosi odpowiedzialność za brak zgodności Towaru z umową wynikający z niewłaściwego zamontowania Towaru, jeżeli:<br />a) zostało ono przeprowadzone przez Sprzedawcę lub na jego odpowiedzialność;<br />b) niewłaściwe zamontowanie przeprowadzone przez Konsumenta lub Przedsiębiorcę z uprawnieniami Konsumenta wynikało z błędów w instrukcji dostarczonej przez przedsiębiorcę lub osobę trzecią.<br />5. Sprzedawca ponosi odpowiedzialność za brak zgodności Towaru z umową istniejący w chwili jego dostarczenia i ujawniony w ciągu dwóch lat od tej chwili, chyba że termin przydatności Towaru do użycia, określony przez Sprzedawcę, jego poprzedników prawnych lub osoby działające w ich imieniu, jest dłuższy. Domniemywa się, że brak zgodności Towaru z umową, który ujawnił się przed upływem dwóch lat od chwili dostarczenia towaru, istniał w chwili jego dostarczenia, o ile nie zostanie udowodnione inaczej lub domniemania tego nie można pogodzić ze specyfiką Towaru lub charakterem braku zgodności Towaru z umową.<br />6. Sprzedawca nie może powoływać się na upływ terminu do stwierdzenia braku zgodności Towaru z umową określonego w §8 ust. 5, jeżeli brak ten podstępnie zataił.<br />7. Jeżeli Towar jest niezgodny z umową, Konsument lub Przedsiębiorca z uprawnieniami Konsumenta może żądać jego naprawy lub wymiany.<br />8. Sprzedawca może dokonać wymiany, gdy Konsument lub Przedsiębiorca z uprawnieniami Konsumenta żąda naprawy, lub Sprzedawca może dokonać naprawy, gdy Konsument lub Przedsiębiorca z uprawnieniami Konsumenta żąda wymiany, jeżeli doprowadzenie do zgodności Towaru z umową w sposób wybrany przez Konsumenta lub Przedsiębiorcę z uprawnieniami Konsumenta jest niemożliwe albo wymagałoby nadmiernych kosztów dla Sprzedawcy. Jeżeli naprawa i wymiana są niemożliwe lub wymagałyby nadmiernych kosztów dla Sprzedawcy, może on odmówić doprowadzenia towaru do zgodności z umową.<br />9. Przy ocenie nadmierności kosztów dla Sprzedawcy uwzględnia się wszelkie okoliczności sprawy, w szczególności znaczenie braku zgodności Towaru z umową, wartość Towaru zgodnego z umową oraz nadmierne niedogodności dla Konsumenta lub Przedsiębiorcy z uprawnieniami Konsumenta powstałe wskutek zmiany sposobu doprowadzenia Towaru do zgodności z umową.<br />10. Sprzedawca dokonuje naprawy lub wymiany w rozsądnym czasie od chwili, w której Sprzedawca został poinformowany przez Konsumenta lub Przedsiębiorcę z uprawnieniami Konsumenta o braku zgodności z umową, i bez nadmiernych niedogodności dla Konsumenta lub Przedsiębiorcy z uprawnieniami Konsumenta, uwzględniając specyfikę Towaru oraz cel, w jakim Konsument lub Przedsiębiorca z uprawnieniami Konsumenta go nabył. Koszty naprawy lub wymiany, w tym w szczególności koszty opłat pocztowych, przewozu, robocizny i materiałów, ponosi Sprzedawca.<br />11. Konsument lub Przedsiębiorca z uprawnieniami Konsumenta udostępnia Sprzedawcy Towar podlegający naprawie lub wymianie. Sprzedawca odbiera od Konsumenta lub Przedsiębiorcy z uprawnieniami Konsumenta Towar na swój koszt.<br />12. Jeżeli Towar został zamontowany przed ujawnieniem się braku zgodności Towaru z umową, Sprzedawca demontuje towar oraz montuje go ponownie po dokonaniu naprawy lub wymiany albo zleca wykonanie tych czynności na swój koszt.<br />13. Konsument lub Przedsiębiorca z uprawnieniami Konsumenta nie jest zobowiązany do zapłaty za zwykłe korzystanie z Towaru, który następnie został wymieniony.<br />14. Jeżeli Towar jest niezgodny z umową Konsument lub Przedsiębiorca z uprawnieniami Konsumenta może złożyć oświadczenie o obniżeniu ceny albo odstąpieniu od umowy, gdy:<br />a) Sprzedawca odmówił doprowadzenia Towaru do zgodności z umową zgodnie z §8 ust. 8 powyżej;<br />b) Sprzedawca nie doprowadził Towaru do zgodności z umową zgodnie z §8 ust. 10 do §8 ust. 12 powyżej;<br />c) brak zgodności Towaru z umową występuje nadal, mimo że Sprzedawca próbował doprowadzić Towar do zgodności z umową;<br />d) brak zgodności Towaru z umową jest na tyle istotny, że uzasadnia obniżenie ceny albo odstąpienie od umowy bez uprzedniego skorzystania ze środków ochrony określonych od §8 ust. 7 do §8 ust. 12 powyżej;<br />e) z oświadczenia Sprzedawcy lub okoliczności wyraźnie wynika, że nie doprowadzi on Towaru do zgodności z umową w rozsądnym czasie lub bez nadmiernych niedogodności dla Konsumenta lub Przedsiębiorcy z uprawnieniami Konsumenta.<br />15. Sprzedawca jest obowiązany udzielić odpowiedzi na reklamację konsumenta w terminie 14 dni od dnia jej otrzymania.<br />16. Sprzedawca zwraca Konsumentowi lub Przedsiębiorcy z uprawnieniami Konsumenta, kwoty należne wskutek skorzystania z prawa obniżenia ceny niezwłocznie, nie później niż w terminie 14 dni od dnia otrzymania oświadczenia Konsumenta lub Przedsiębiorcy z uprawnieniami Konsumenta o obniżeniu ceny.<br />17. Konsument lub Przedsiębiorca z uprawnieniami Konsumenta nie może odstąpić od umowy, jeżeli brak zgodności Towaru z umową jest nieistotny. Domniemywa się, że brak zgodności Towaru z umową jest istotny.<br />18. Jeżeli brak zgodności z umową dotyczy jedynie niektórych Towarów dostarczonych na podstawie umowy Konsument lub Przedsiębiorca z uprawnieniami Konsumenta może odstąpić od umowy jedynie w odniesieniu do tych Towarów, a także w odniesieniu do innych Towarów nabytych przez Konsumenta lub Przedsiębiorcę z uprawnieniami Konsumenta wraz z Towarami niezgodnymi z umową, jeżeli nie można rozsądnie oczekiwać, aby Konsument lub Przedsiębiorca z uprawnieniami Konsumenta zgodził się zatrzymać wyłącznie Towary zgodne z umową.<br />19. W razie odstąpienia od umowy Konsument lub Przedsiębiorca z uprawnieniami Konsumenta niezwłocznie zwraca Towar Sprzedawcy na jego koszt. Sprzedawca zwraca Konsumentowi lub Przedsiębiorcy z uprawnieniami Konsumenta cenę niezwłocznie, nie później niż w terminie 14 dni od dnia otrzymania Towaru lub dowodu jego odesłania.<br />20. Sprzedawca dokonuje zwrotu ceny przy użyciu takiego samego sposobu zapłaty, jakiego użył Konsument lub Przedsiębiorca z uprawnieniami Konsumenta, chyba że Konsument lub Przedsiębiorca z uprawnieniami Konsumenta wyraźnie zgodził się na inny sposób zwrotu, który nie wiąże się dla niego z żadnymi kosztami.<br />21. Sprzedawca nie korzysta z pozasądowego rozwiązywania sporów, o których mowa w ustawie z dnia 23 września 2016 r. o pozasądowym rozwiązywaniu sporów konsumenckich.<br /><br />§ 9 Gwarancja<br />1. Towary sprzedawane przez Sprzedawcę mogą być objęte gwarancją udzieloną przez producenta Towaru bądź dystrybutora.<br />2. W wypadku Towarów objętych gwarancją, informacja dotycząca istnienia i treści gwarancji jest każdorazowo prezentowana na Stronie Internetowej Sklepu.<br /><br />§ 10 Odstąpienie od Umowy sprzedaży<br />1. Klient będący Konsumentem oraz Przedsiębiorca z uprawnieniami Konsumenta, który zawarł Umowę sprzedaży, może w terminie 14 dni odstąpić od niej bez podawania przyczyny.<br />2. Bieg terminu na odstąpienie od Umowy sprzedaży rozpoczyna się od chwili objęcia Towaru w posiadanie przez Konsumenta, Przedsiębiorcę z uprawnieniami Konsumenta lub wskazaną przez nich osobę trzecią inną niż przewoźnik.<br />Konsument oraz Przedsiębiorca z uprawnieniami Konsumenta może odstąpić od Umowy sprzedaży składając Sprzedawcy oświadczenie o odstąpieniu. Oświadczenie to może zostać złożone przykładowo pisemnie na adres Sprzedawcy, tj.: Network Lab Jakub Kuszyński, ul. Garwolińska 9/95 (04-348), Warszawa, lub też za pośrednictwem poczty elektronicznej na adres Sprzedawcy, tj.: kontakt@monsteriada.pl. Oświadczenie można złożyć na formularzu, którego wzór został zamieszczony przez Sprzedawcę na Stronie Internetowej Sklepu pod adresem: <a href=\"https://www.rzetelnyregulamin.pl/pl/d/f-5896287c1423e63def4155ee5f3e0a85\" style=\"background-color:transparent;\">Formularz odstąpienia</a>. Do zachowania terminu wystarczy wysłanie oświadczenia przed jego upływem.<br />Konsument oraz Przedsiębiorca z uprawnieniami Konsumenta może odstąpić od Umowy sprzedaży, składając Sprzedawcy oświadczenie o odstąpieniu za pośrednictwem formularza udostępnionego na stronie internetowej pod adresem: <a href=\"https://www.rzetelnyregulamin.pl/pl/dla-konsumenta/formularz-odstapienia-od-umowy,sklep-626d5181ba4220e63c87162b847c7f05\" style=\"background-color:transparent;\">Elektroniczny Formularz odstąpienia</a>. Do zachowania terminu wystarczy wysłanie oświadczenia przed jego upływem. Sprzedawca niezwłocznie potwierdza Konsumentowi oraz Przedsiębiorcy z uprawnieniami Konsumenta otrzymanie formularza złożonego za pośrednictwem strony internetowej.<br />3. W przypadku odstąpienia od Umowy sprzedaży jest ona uważana za niezawartą.<br />4. Jeśli Konsument lub Przedsiębiorca z uprawnieniami Konsumenta złożył oświadczenie o odstąpieniu od Umowy sprzedaży, zanim Sprzedawca przyjął jego ofertę, oferta przestaje wiązać.<br />5. Sprzedawca ma obowiązek niezwłocznie, nie później niż w terminie 14 dni od dnia otrzymania oświadczenia Konsumenta, lub Przedsiębiorcy z uprawnieniami Konsumenta o odstąpieniu od Umowy sprzedaży, zwrócić mu wszystkie dokonane przez niego płatności, w tym koszt Dostawy Towaru do Konsumenta, lub Przedsiębiorcy z uprawnieniami Konsumenta. Sprzedawca może wstrzymać się ze zwrotem płatności otrzymanych od Konsumenta, lub Przedsiębiorcy z uprawnieniami Konsumenta do chwili otrzymania z powrotem Towaru, lub dostarczenia przez Konsumenta, lub Przedsiębiorcy z uprawnieniami Konsumenta dowodu odesłania Towaru, w zależności od tego, które zdarzenie nastąpi wcześniej.<br />6. Jeżeli Konsument lub Przedsiębiorca z uprawnieniami Konsumenta korzystający z prawa do odstąpienia wybrał sposób dostarczenia Towaru inny niż najtańszy zwykły sposób Dostawy oferowany przez Sprzedawcę, Sprzedawca nie jest zobowiązany do zwrotu Konsumentowi lub Przedsiębiorcy z uprawnieniami Konsumenta poniesionych przez niego dodatkowych kosztów.<br />7. Konsument lub Przedsiębiorca z uprawnieniami Konsumenta ma obowiązek zwrócić Towar Sprzedawcy niezwłocznie, jednak nie później niż w terminie 14 dni od dnia, w którym odstąpił od Umowy sprzedaży. Do zachowania terminu wystarczy odesłanie Towaru na adres Sprzedawcy przed upływem tego terminu.<br />8. W wypadku odstąpienia Klient będący Konsumentem lub Przedsiębiorca z uprawnieniami Konsumenta ponosi tylko bezpośrednie koszty zwrotu.<br />9. Jeśli ze względu na swój charakter Towar nie może zostać w zwykłym trybie odesłany pocztą, Sprzedawca informuje Konsumenta oraz Przedsiębiorcę z uprawnieniami Konsumenta o kosztach zwrotu rzeczy na Stronie Internetowej Sklepu.<br />10. Konsument oraz Przedsiębiorca z uprawnieniami Konsumenta ponosi odpowiedzialność za zmniejszenie wartości Towaru będące wynikiem korzystania z niego w sposób wykraczający poza sposób konieczny do stwierdzenia charakteru, cech i funkcjonowania Towaru.<br />11. Sprzedawca dokonuje zwrotu płatności przy użyciu takiego samego sposobu zapłaty, jakiego użył Konsument lub Przedsiębiorca z uprawnieniami Konsumenta chyba, że Konsument lub Przedsiębiorca z uprawnieniami Konsumenta wyraźnie zgodził się na inny sposób zwrotu, który nie wiąże się dla niego z żadnymi kosztami.<br />12. Prawo odstąpienia od Umowy sprzedaży nie przysługuje Konsumentowi oraz Przedsiębiorcy z uprawnieniami Konsumenta w odniesieniu do umów, w których Towarem jest rzecz ulegająca szybkiemu zepsuciu lub mająca krótki termin przydatności do użycia.<br />13. Prawo odstąpienia od Umowy sprzedaży nie przysługuje Konsumentowi oraz Przedsiębiorcy z uprawnieniami Konsumenta w odniesieniu do umów, w których Towarem jest rzecz dostarczana w zapieczętowanym opakowaniu, której po otwarciu opakowania nie można zwrócić ze względu na ochronę zdrowia lub ze względów higienicznych, jeżeli opakowanie zostało otwarte po dostarczeniu.<br />14. Prawo odstąpienia od Umowy sprzedaży nie przysługuje Konsumentowi oraz Przedsiębiorcy z uprawnieniami Konsumenta w odniesieniu do umów, w której przedmiotem świadczenia są nagrania dźwiękowe lub wizualne albo programy komputerowe dostarczane w zapieczętowanym opakowaniu, jeżeli opakowanie zostało otwarte po dostarczeniu.<br /><br />§ 11 Usługi nieodpłatne<br />1. Sprzedawca świadczy na rzecz Klientów, drogą elektroniczną usługi nieodpłatne:<br />a) Formularz kontaktowy;<br />b) Newsletter;<br />c) Prowadzenie Konta Klienta;<br />d) Zamieszczanie opinii.<br />2. Usługi wskazane w §11 ust. 1 powyżej świadczone są 7 dni w tygodniu, 24 godziny na dobę.<br />3. Sprzedawca zastrzega sobie możliwość wyboru i zmiany rodzaju, form, czasu oraz sposobu udzielania dostępu do wybranych wymienionych usług, o czym poinformuje Klientów w sposób właściwy dla zmiany Regulaminu.<br />4. Usługa Formularz kontaktowy polega na wysłaniu za pomocą formularza umieszczonego na Stronie Internetowej Sklepu wiadomości do Sprzedawcy.<br />5. Rezygnacja z usługi nieodpłatnej Formularz kontaktowy, możliwa jest w każdej chwili i polega na zaprzestaniu wysyłania zapytań do Sprzedawcy.<br />6. Z usługi Newsletter może skorzystać każdy Klient, który wprowadzi swój adres poczty elektronicznej, wykorzystując w tym celu formularz rejestracyjny udostępniony przez Sprzedawcę na Stronie Internetowej Sklepu. Po przesłaniu wypełnionego formularza rejestracyjnego, Klient otrzymuje niezwłocznie, drogą elektroniczną na adres poczty elektronicznej podany w formularzu rejestracyjnym link aktywacyjny, w celu potwierdzenia zapisania się na subskrypcję Newsletter. Z chwilą aktywacji linku przez Klienta zawarta zostaje umowa o świadczenie drogą elektroniczną usługi Newsletter.<br />7. Usługa Newsletter polega na przesyłaniu przez Sprzedawcę, na adres poczty elektronicznej, wiadomości w formie elektronicznej zawierającej informacje o nowych produktach lub usługach w ofercie Sprzedawcy. Newsletter przesyłany jest przez Sprzedawcę do wszystkich Klientów, którzy dokonali subskrypcji.<br />8. Każdy Newsletter kierowany do danych Klientów zawiera w szczególności: informację o nadawcy, wypełnione pole „temat”, określające treść przesyłki oraz informację o możliwości i sposobie rezygnacji z usługi nieodpłatnej Newsletter.<br />9. Klient może w każdej chwili zrezygnować z otrzymywania Newsletter’a przez wypisanie się z subskrypcji za pośrednictwem odnośnika zamieszczonego w każdej wiadomości elektronicznej wysłanej w ramach usługi Newsletter lub za pośrednictwem dezaktywacji odpowiedniego pola w Koncie Klienta.<br />10. Usługa Prowadzenie Konta Klienta dostępna jest po dokonaniu Rejestracji na zasadach opisanych w Regulaminie i polega na udostępnieniu Klientowi dedykowanego panelu w ramach Strony Internetowej Sklepu, umożliwiającego Klientowi modyfikacje danych, które podał podczas Rejestracji, jak też śledzenia stanu realizacji zamówień oraz historii zamówień już zrealizowanych.<br />11. Klient, który dokonał Rejestracji może zgłosić Sprzedawcy żądanie usunięcia Konta Klienta, przy czym w przypadku zgłoszenia żądania usunięcia Konta Klienta przez Sprzedawcę, może ono zostać usunięte do 14 dni od zgłoszenia żądania.<br />12. Usługa Zamieszczanie opinii polega na umożliwieniu przez Sprzedawcę, Klientom posiadającym Konto Klienta publikacji na Stronie Internetowej Sklepu indywidualnych i subiektywnych wypowiedzi Klienta dotyczących w szczególności Towarów.<br />13. Rezygnacja z usługi Zamieszczanie opinii możliwa jest w każdej chwili i polega na zaprzestaniu zamieszczania treści przez Klienta na Stronie Internetowej Sklepu.<br />14. Sprzedawca jest uprawniony do zablokowania dostępu do Konta Klienta i usług nieodpłatnych, w przypadku działania przez Klienta na szkodę Sprzedawcy, tj. prowadzenia działalności reklamowej innego przedsiębiorcy lub produktu; działalności polegającej na zamieszczaniu treści nie związanych z działalnością Sprzedawcy; działalności polegającej na zamieszczaniu treści nieprawdziwych lub wprowadzających w błąd, jak również w przypadku działania przez Klienta na szkodę innych Klientów, naruszenia przez Klienta przepisów prawa lub postanowień Regulaminu, a także, gdy zablokowanie dostępu do Konta Klienta i usług nieodpłatnych jest uzasadnione względami bezpieczeństwa - w szczególności: przełamywaniem przez Klienta zabezpieczeń Strony Internetowej Sklepu lub innymi działaniami hakerskimi. Zablokowanie dostępu do Konta Klienta i usług nieodpłatnych z wymienionych przyczyn trwa przez okres niezbędny do rozwiązania kwestii stanowiącej podstawę zablokowania dostępu do Konta Klienta i usług nieodpłatnych. Sprzedawca zawiadamia Klienta o zablokowaniu dostępu do Konta Klienta i usług nieodpłatnych drogą elektroniczną na adres podany przez Klienta w formularzu rejestracyjnym.<br />15. Klient może zgłosić Sprzedawcy reklamację w związku z korzystaniem z usług nieodpłatnych świadczonych drogą elektroniczną przez Sprzedawcę. Reklamacja może być złożona przykładowo w formie elektronicznej i przesłana na adres kontakt@monsteriada.pl lub za pośrednictwem Konta Klienta, na zasadach opisanych na Stronie Internetowej Sklepu. W zgłoszeniu reklamacyjnym Klient winien zawrzeć opis zaistniałego problemu. Sprzedawca niezwłocznie, lecz nie później niż w terminie 14 dni rozpatruje reklamacje i udziela Klientowi odpowiedzi.<br /><br />§ 12 Odpowiedzialność Klienta w zakresie zamieszczanych przez niego treści<br />1. Zamieszczając treści oraz udostępniając je, Klient dokonuje dobrowolnego rozpowszechniania treści. Zamieszczane treści nie wyrażają poglądów Sprzedawcy i nie powinny być utożsamiane z jego działalnością. Sprzedawca nie jest dostawcą treści, a jedynie podmiotem, który zapewnia w tym celu odpowiednie zasoby teleinformatyczne.<br />2. Klient oświadcza, że:<br />a) jest uprawniony do korzystania z autorskich praw majątkowych, praw własności przemysłowej i/lub praw pokrewnych do – odpowiednio - utworów, przedmiotów praw własności przemysłowej (np. znaki towarowe) i/lub przedmiotów praw pokrewnych, które składają się na treści;<br />b) umieszczenie oraz udostępnienie w ramach usług, o których mowa w §11 Regulaminu, danych osobowych, wizerunku oraz informacji dotyczących osób trzecich nastąpiło w sposób legalny, dobrowolny oraz za zgodą osób, których one dotyczą;<br />c) wyraża zgodę na wgląd do opublikowanych treści przez innych Klientów oraz Sprzedawcę, jak również upoważnia Sprzedawcę do ich wykorzystania nieodpłatnie zgodnie z postanowieniami niniejszego Regulaminu;<br />d) wyraża zgodę na dokonywanie opracowań utworów w rozumieniu Ustawy o prawie autorskim i prawach pokrewnych.<br />3. Klient nie jest uprawniony do:<br />a) zamieszczania w ramach korzystania z usług, o których mowa w §11 Regulaminu, danych osobowych osób trzecich oraz rozpowszechniania wizerunku osób trzecich bez wymaganego prawem zezwolenia lub zgody osoby trzeciej;<br />b) zamieszczania w ramach korzystania z usług, o których mowa w §11 Regulaminu, treści o charakterze reklamowym i/lub promocyjnym.<br />4. Sprzedawca ponosi odpowiedzialność za zamieszczane przez Klientów treści pod warunkiem otrzymania powiadomienia zgodnie z §13 Regulaminu.<br />5. Zabronione jest zamieszczanie przez Klientów w ramach korzystania z usług, o których mowa w §11 Regulaminu treści, które mogłyby w szczególności:<br />a) zostać zamieszczane w złej wierze, np. z zamiarem naruszenia dóbr osobistych osób trzecich;<br />b) naruszać jakiekolwiek prawa osób trzecich, w tym prawa związane z ochroną praw autorskich i praw pokrewnych, ochroną praw własności przemysłowej, tajemnicą przedsiębiorstwa lub mające związek ze zobowiązaniami o zachowaniu poufności;<br />c) posiadać charakter obraźliwy bądź stanowić groźbę skierowaną do innych osób, zawierałyby słownictwo naruszające dobre obyczaje (np. poprzez użycie wulgaryzmów lub określeń powszechnie uznawanych za obraźliwe);<br />d) pozostawać w sprzeczności z interesem Sprzedawcy, tj. treści stanowiących materiały o charakterze reklamowym innego przedsiębiorcy lub produktu; treści nie związanych z działalnością Sprzedawcy; treści nieprawdziwych lub wprowadzających w błąd;<br />e) naruszać w inny sposób postanowienia Regulaminu, dobre obyczaje, przepisy obowiązującego prawa, normy społeczne lub obyczajowe.<br />6. W przypadku otrzymania powiadomienia zgodnie z §13 Regulaminu, Sprzedawca zastrzega sobie prawo do modyfikowania lub usuwania treści zamieszczanych przez Klientów w ramach korzystania przez nich z usług, o których mowa w §11 Regulaminu, w szczególności w odniesieniu do treści, co do których, opierając się na doniesieniach osób trzecich lub odpowiednich organów, stwierdzono, że mogą one stanowić naruszenie niniejszego Regulaminu lub obowiązujących przepisów prawa. Sprzedawca nie prowadzi bieżącej kontroli zamieszczanych treści.<br />7. Klient wyraża zgodę na nieodpłatne wykorzystywanie przez Sprzedawcę umieszczonych przez niego treści w ramach Strony Internetowej Sklepu.<br /><br />§ 13 Zgłaszanie zagrożenia lub naruszenia praw<br />1. W przypadku gdy Klient lub inna osoba lub podmiot uzna, iż treść publikowana na Stronie Internetowej Sklepu narusza ich prawa, dobra osobiste, dobre obyczaje, uczucia, moralność, przekonania, zasady uczciwej konkurencji, know-how, tajemnicę chronioną prawem lub na podstawie zobowiązania, może powiadomić Sprzedawcę o potencjalnym naruszeniu.<br />2. Sprzedawca powiadomiony o potencjalnym naruszeniu podejmuje niezwłoczne działania mające na celu usunięcie ze Strony Internetowej Sklepu, treści będących przyczyną naruszenia.<br /><br />§ 14 Ochrona danych osobowych<br />1. Zasady ochrony Danych Osobowych zamieszczone są w Polityce prywatności.<br /><br />§ 15 Rozwiązanie umowy (nie dotyczy Umów sprzedaży)<br />1. Zarówno Klient, jak i Sprzedawca mogą rozwiązać umowę o świadczenie usług drogą elektroniczną w każdym czasie i bez podania przyczyn, z zastrzeżeniem zachowania praw nabytych przez drugą stronę przed rozwiązaniem ww. umowy oraz postanowień poniżej.<br />2. Klient, który dokonał Rejestracji, rozwiązuje umowę o świadczenie usług drogą elektroniczną poprzez wysłanie do Sprzedawcy stosownego oświadczenia woli, przy użyciu dowolnego środka komunikacji na odległość, umożliwiającego zapoznanie się Sprzedawcy z oświadczeniem woli Klienta.<br />3. Sprzedawca wypowiada umowę o świadczenie usług drogą elektroniczną poprzez wysłanie do Klienta stosownego oświadczenia woli na adres poczty elektronicznej podany przez Klienta podczas Rejestracji.<br /><br />§ 16 Postanowienia końcowe<br />1. Sprzedawca ponosi odpowiedzialność z tytułu niewykonania lub nienależytego wykonania umowy, lecz w przypadku umów zawieranych z Klientami będącymi Przedsiębiorcami Sprzedawca ponosi odpowiedzialność tylko w przypadku umyślnego wyrządzenia szkody i w granicach rzeczywiście poniesionych strat przez Klienta będącego Przedsiębiorcą.<br />2. Treść niniejszego Regulaminu może zostać utrwalona poprzez wydrukowanie, zapisanie na nośniku lub pobranie w każdej chwili ze Strony Internetowej Sklepu.<br />3. W przypadku powstania sporu na gruncie zawartej Umowy sprzedaży strony będą dążyły do rozwiązania sprawy polubownie. Prawem właściwym dla rozstrzygania wszelkich sporów powstałych na gruncie niniejszego Regulaminu jest prawo polskie.<br />4. Sprzedawca informuje Klienta będącego Konsumentem o możliwości skorzystania z pozasądowych sposobów rozpatrywania reklamacji i dochodzenia roszczeń. Zasady dostępu do tych procedur dostępne są w siedzibach lub na stronach internetowych podmiotów uprawnionych do pozasądowego rozpatrywania sporów. Mogą nimi być w szczególności rzecznicy praw konsumenta lub Wojewódzkie Inspektoraty Inspekcji Handlowej, których lista jest dostępna na stronie internetowej <a href=\"http://www.uokik.gov.pl/spory_konsumenckie.php\" style=\"background-color:transparent;\">Urzędu Ochrony Konkurencji i Konsumentów</a>.<br />Sprzedawca informuje, że pod adresem <a href=\"https://ec.europa.eu/consumers/odr/\" style=\"background-color:transparent;\">https://ec.europa.eu/consumers/odr/</a> dostępna jest platforma internetowego systemu rozstrzygania sporów pomiędzy konsumentami i przedsiębiorcami na szczeblu unijnym (platforma ODR).<br />5. Sprzedawca zastrzega sobie prawo zmiany niniejszego Regulaminu. Wszystkie zamówienia przyjęte przez Sprzedawcę do realizacji przed dniem wejścia w życie nowego Regulaminu są realizowane na podstawie Regulaminu, który obowiązywał w dniu składania zamówienia przez Klienta. Zmiana Regulaminu wchodzi w życie w terminie 7 dni od dnia opublikowania na Stronie Internetowej Sklepu. Sprzedawca poinformuje Klienta na 7 dni przed wejściem w życie nowego Regulaminu o zmianie Regulaminu za pomocą wiadomości przesłanej drogą elektroniczną zawierającej odnośnik do tekstu zmienionego Regulaminu. W razie, gdy Klient nie akceptuje nowej treści Regulaminu obowiązany jest zawiadomić o tym fakcie Sprzedawcę, co skutkuje rozwiązaniem umowy zgodnie z postanowieniami §15 Regulaminu.<br />6. Umowy ze Sprzedawcą zawierane są w języku polskim.<br />7. Regulamin wchodzi w życie z dniem 08.04.2023 r.</i></p>\r\n\r\n\r\n</div>\r\n</div>\r\n</div>\r\n','regulamin'),(3,1,1,'Polityka prywatności','','','','<h1 style=\"font-size:36px;margin:0px;font-family:inherit;font-weight:bold;line-height:1.1;padding:0px 0px 30px;text-transform:none;\">Polityka prywatności</h1>\r\n\r\n\r\n<table class=\"m-0 spacing-table\" style=\"border-collapse:collapse;background-color:transparent;margin:0px;\">\r\n<tbody>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">1.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Niniejsza Polityka Prywatności określa zasady przetwarzania danych osobowych pozyskanych za pośrednictwem sklepu internetowego <a href=\"http://monsteriada.pl/\" target=\"_blank\" rel=\"nofollow noreferrer noopener\" style=\"background-color:transparent;\">monsteriada.pl</a> (zwanego dalej: „<span style=\"font-weight:bolder;\">Sklepem Internetowym</span>”).</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">2.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Właścicielem Sklepu i jednocześnie administratorem danych jest Jakub Kuszyński prowadzący działalność gospodarczą pod firmą Network Lab Jakub Kuszyński z siedzibą w Warszawie (04-348), ul. Garwolińska 9/95, wpisaną do Centralnej Ewidencji i Informacji o Działalności Gospodarczej prowadzonej przez Ministra Rozwoju i Technologii, NIP: 1132576111, REGON: 142108492, zwany dalej <span style=\"font-weight:bolder;\">Network Lab Jakub Kuszyński</span>.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">3.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Dane osobowe zbierane przez Network Lab Jakub Kuszyński za pośrednictwem Sklepu Internetowego są przetwarzane zgodnie z Rozporządzeniem Parlamentu Europejskiego i Rady (UE) 2016/679 z dnia 27 kwietnia 2016 r. w sprawie ochrony osób fizycznych w związku z przetwarzaniem danych osobowych i w sprawie swobodnego przepływu takich danych oraz uchylenia dyrektywy 95/46/WE (ogólne rozporządzenie o ochronie danych), zwane również <span style=\"font-weight:bolder;\">RODO</span>.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">4.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Network Lab Jakub Kuszyński dokłada szczególnej staranności do poszanowania prywatności Klientów odwiedzających Sklep Internetowy.</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"11\" style=\"vertical-align:top;margin:15px 0px;text-align:center;font-weight:bold;\"><span class=\"anchor\"></span>§ 1 Rodzaj przetwarzanych danych, cele oraz podstawa prawna</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">1.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Network Lab Jakub Kuszyński zbiera informacje dotyczące osób fizycznych dokonujących czynności prawnej niezwiązanej bezpośrednio z ich działalnością, osób fizycznych prowadzących we własnym imieniu działalność gospodarczą lub zawodową oraz osób fizycznych reprezentujących osoby prawne, lub jednostki organizacyjne niebędące osobami prawnymi, którym ustawa przyznaje zdolność prawną, zwanych dalej łącznie <span style=\"font-weight:bolder;\">Klientami</span>.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">2.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Dane osobowe Klientów są zbierane w przypadku:</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">rejestracji konta w Sklepie Internetowym, w celu utworzenia indywidualnego konta i zarządzania tym kontem. <span style=\"font-weight:bolder;\">Podstawa prawna</span>: niezbędność do wykonania umowy o świadczenie usługi Konta (art. 6 ust. 1 lit. b RODO);</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">b)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">składania zamówienia w Sklepie Internetowym, w celu wykonania umowy sprzedaży. <span style=\"font-weight:bolder;\">Podstawa prawna</span>: niezbędność do wykonania umowy sprzedaży (art. 6 ust. 1 lit. b RODO);</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">c)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">subskrypcji biuletynu informacyjnego (Newsletter), w celu wykonania umowy, której przedmiotem jest usługa świadczona drogą elektroniczną. <span style=\"font-weight:bolder;\">Podstawa prawna</span> - zgoda osoby, której dane dotyczą na wykonanie umowy o świadczenie usługi Newsletter (art. 6 ust. 1 lit. a RODO);</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">d)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">korzystania z usługi formularza kontaktowego w Sklepie Internetowym w celu wykonania umowy świadczonej drogą elektroniczną. <span style=\"font-weight:bolder;\">Podstawa prawna</span>: niezbędność do wykonania umowy o świadczenie usługi formularza kontaktowego (art. 6 ust. 1 lit. b RODO);</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">e)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">korzystania z usługi zamieść opinię w celu wykonania umowy, której przedmiotem jest usługa świadczona drogą elektroniczną. <span style=\"font-weight:bolder;\">Podstawa prawna</span> - niezbędność do wykonania umowy o świadczenie usługi zamieść opinię (art. 6 ust. 1 lit. b RODO).</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">3.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">W przypadku rejestracji konta w Sklepie Internetowym, Klient podaje:</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">adres e-mail;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">b)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">imię i nazwisko.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">4.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Podczas rejestracji konta w Sklepie Internetowym Klient samodzielnie ustala indywidualne hasło dostępu do swojego konta. Klient może zmienić hasło, w późniejszym czasie, na zasadach opisanych w §5.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">5.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">W przypadku składania zamówienia w Sklepie Internetowym, Klient podaje następujące dane:</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">adres e-mail;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">b)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">dane adresowe:</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"4\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a.</td>\r\n<td colspan=\"6\" style=\"vertical-align:top;\">kod pocztowy i miejscowość;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"4\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">b.</td>\r\n<td colspan=\"6\" style=\"vertical-align:top;\">kraj (państwo);</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"4\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">c.</td>\r\n<td colspan=\"6\" style=\"vertical-align:top;\">ulica wraz z numerem domu/mieszkania.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">c)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">imię i nazwisko;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">d)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">numer telefonu.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">6.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">W przypadku Przedsiębiorców, powyższy zakres danych jest dodatkowo poszerzony o:</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">firmę Przedsiębiorcy;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">b)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">numer NIP.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">7.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">W przypadku skorzystania z usługi Newsletter, Klient podaje jedynie swój adres e-mail.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">8.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">W przypadku skorzystania z usługi formularza kontaktowego, Klient podaje jedynie swój adres e-mail.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">9.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">W przypadku skorzystania z usługi zamieść opinię, Klient podaje następujące dane:</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">imię i nazwisko.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">10.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Podczas korzystania ze Strony Internetowej Sklepu mogą być pobierane dodatkowe informacje, w szczególności: adres IP przypisany do komputera Klienta lub zewnętrzny adres IP dostawcy Internetu, nazwa domeny, rodzaj przeglądarki, czas dostępu, typ systemu operacyjnego.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">11.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Od Klientów mogą być także gromadzone dane nawigacyjne, w tym informacje o linkach i odnośnikach, w które zdecydują się kliknąć lub innych czynnościach, podejmowanych w Sklepie Internetowym. <span style=\"font-weight:bolder;\">Podstawa prawna</span> - prawnie uzasadniony interes (art. 6 ust. 1 lit. f RODO), polegający na ułatwieniu korzystania z usług świadczonych drogą elektroniczną oraz na poprawie funkcjonalności tych usług.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">12.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">W celu ustalania, dochodzenia i egzekucji roszczeń mogą być przetwarzane niektóre dane osobowe podane przez Klienta w ramach korzystania z funkcjonalności w Sklepie Internetowym takie jak: imię, nazwisko, dane dotyczące korzystania z usług, jeżeli roszczenia wynikają ze sposobu, w jaki Klient korzysta z usług, inne dane niezbędne do udowodnienia istnienia roszczenia, w tym rozmiarów poniesionej szkody. <span style=\"font-weight:bolder;\">Podstawa prawna</span> - prawnie uzasadniony interes (art. 6 ust. 1 lit. f RODO), polegający na ustaleniu, dochodzeniu i egzekucji roszczeń oraz na obronie przed roszczeniami w postępowaniu przed sądami i innymi organami państwowymi.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">13.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Przekazanie danych osobowych do Network Lab Jakub Kuszyński jest dobrowolne, w związku z zawieranymi umowami sprzedaży, czy też świadczenia usług za pośrednictwem Strony Internetowej Sklepu, z tym jednak zastrzeżeniem, że niepodanie określonych w formularzach danych w procesie Rejestracji uniemożliwia Rejestrację i założenie Konta Klienta, zaś w przypadku składania zamówienia bez Rejestracji Konta Klienta uniemożliwi złożenie i realizację zamówienia Klienta.</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"11\" style=\"vertical-align:top;margin:15px 0px;text-align:center;font-weight:bold;\"><span class=\"anchor\"></span>§ 2 Komu udostępniane lub powierzane są dane oraz jak długo są przechowywane?</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">1.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Dane osobowe Klienta przekazywane są dostawcom usług, z których korzysta Network Lab Jakub Kuszyński przy prowadzeniu Sklepu Internetowego. Dostawcy usług, którym przekazywane są dane osobowe, w zależności od uzgodnień umownych i okoliczności, albo podlegają poleceniom Network Lab Jakub Kuszyński co do celów i sposobów przetwarzania tych danych (podmioty przetwarzające), albo samodzielnie określają cele i sposoby ich przetwarzania (administratorzy).</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\"><span style=\"font-weight:bolder;\">Podmioty przetwarzające</span>. Network Lab Jakub Kuszyński korzysta z dostawców, którzy przetwarzają dane osobowe wyłącznie na polecenie Network Lab Jakub Kuszyński. Należą do nich m.in. dostawcy świadczący usługę hostingu, usługi księgowe, dostarczający systemy do marketingu, systemy do analizy ruchu w Sklepie Internetowym, systemy do analizy skuteczności kampanii marketingowych;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">b)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\"><span style=\"font-weight:bolder;\">Administratorzy</span>. Network Lab Jakub Kuszyński korzysta z dostawców, którzy nie działają wyłącznie na polecenie i sami ustalają cele i sposoby wykorzystania danych osobowych Klientów. Świadczą oni usługi płatności elektronicznych oraz bankowe.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">2.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\"><span style=\"font-weight:bolder;\">Lokalizacja</span>. Dostawcy usług mają siedziby w Polsce i w innych krajach Europejskiego Obszaru Gospodarczego (EOG).</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">3.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Dane osobowe Klientów przechowywane są:</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">W przypadku gdy podstawą przetwarzania danych osobowych jest zgoda, wówczas dane osobowe Klienta przetwarzane są przez Network Lab Jakub Kuszyński tak długo, aż zgoda nie zostanie odwołana, a po odwołaniu zgody przez okres czasu odpowiadający okresowi przedawnienia roszczeń jakie może podnosić Network Lab Jakub Kuszyński i jakie mogą być podnoszone wobec niego. Jeżeli przepis szczególny nie stanowi inaczej, termin przedawnienia wynosi lat sześć, a dla roszczeń o świadczenia okresowe oraz roszczeń związanych z prowadzeniem działalności gospodarczej - trzy lata.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">b)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">W przypadku gdy podstawą przetwarzania danych jest wykonanie umowy, wówczas dane osobowe Klienta przetwarzane są przez Network Lab Jakub Kuszyński tak długo, jak jest to niezbędne do wykonania umowy, a po tym czasie przez okres odpowiadający okresowi przedawnienia roszczeń. Jeżeli przepis szczególny nie stanowi inaczej, termin przedawnienia wynosi lat sześć, a dla roszczeń o świadczenia okresowe oraz roszczeń związanych z prowadzeniem działalności gospodarczej - trzy lata.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">4.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">W przypadku dokonania zakupu w Sklepie Internetowym, dane osobowe mogą być przekazywane, w zależności od wyboru Klienta, następującym podmiotom w celu dostarczenia zamówionych towarów:</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">firmie dropshippingowej;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">b)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">firmie kurierskiej;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">c)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">firmie InPost Paczkomaty Sp. z o.o. z siedzibą w Krakowie, świadczącej usługi dostawy i obsługi systemu skrytek pocztowych (Paczkomaty).</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">5.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">W przypadku, gdy Klient wybierze płatność poprzez system PayU, jego dane osobowe są przekazywane w zakresie niezbędnym dla realizacji płatności spółce PayU S.A. z siedzibą w Poznaniu (60-166), przy ul. Grunwaldzkiej 182, wpisanej do rejestru przedsiębiorców prowadzonego przez Sąd Rejonowy Poznań - Nowe Miasto i Wilda w Poznaniu, Wydział VIII Gospodarczy Krajowego Rejestru Sądowego pod numerem KRS 0000274399.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">6.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Dane nawigacyjne mogą być wykorzystywane w celu zapewnienia Klientom lepszej obsługi, analizy danych statystycznych i dostosowania Sklepu Internetowego do preferencji Klientów, a także administrowania Sklepem Internetowym.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">7.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">W przypadku gdy Klient dokona subskrypcji biuletynu informacyjnego (Newsletter) na jego adres e-mail Network Lab Jakub Kuszyński będzie wysyłać wiadomości elektroniczne zawierające informacje handlowe o promocjach i nowych produktach dostępnych w Sklepie Internetowym.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">8.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">W przypadku skierowania żądania Network Lab Jakub Kuszyński udostępnia dane osobowe uprawnionym organom państwowym, w szczególności jednostkom organizacyjnym Prokuratury, Policji, Prezesowi Urzędu Ochrony Danych Osobowych, Prezesowi Urzędu Ochrony Konkurencji i Konsumentów lub Prezesowi Urzędu Komunikacji Elektronicznej.</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"11\" style=\"vertical-align:top;margin:15px 0px;text-align:center;font-weight:bold;\"><span class=\"anchor\"></span>§ 3 Mechanizm cookies, adres IP</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">1.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Sklep Internetowy używa niewielkich plików, zwanych cookies. Zapisywane są one przez Network Lab Jakub Kuszyński na urządzeniu końcowym osoby odwiedzającej Sklep Internetowy, jeżeli przeglądarka internetowa na to pozwala. Plik cookie zwykle zawiera nazwę domeny, z której pochodzi, swój „czas wygaśnięcia\" oraz indywidualną, losowo wybraną liczbę identyfikującą ten plik. Informacje zbierane za pomocą plików tego typu pomagają dostosowywać oferowane przez Network Lab Jakub Kuszyński produkty do indywidualnych preferencji i rzeczywistych potrzeb osób odwiedzających Sklep Internetowy. Dają też możliwość opracowywania ogólnych statystyk odwiedzin prezentowanych produktów w Sklepie Internetowym.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">2.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Network Lab Jakub Kuszyński wykorzystuje dwa typy plików cookies:</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\"><span style=\"font-weight:bolder;\">Cookies sesyjne</span>: po zakończeniu sesji danej przeglądarki lub wyłączeniu komputera zapisane informacje są usuwane z pamięci urządzenia. Mechanizm cookies sesyjnych nie pozwala na pobieranie jakichkolwiek danych osobowych ani żadnych informacji poufnych z komputerów Klientów.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">b)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\"><span style=\"font-weight:bolder;\">Cookies trwałe</span>: są przechowywane w pamięci urządzenia końcowego Klienta i pozostają tam do momentu ich skasowania lub wygaśnięcia. Mechanizm cookies trwałych nie pozwala na pobieranie jakichkolwiek danych osobowych ani żadnych informacji poufnych z komputera Klientów.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">3.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Network Lab Jakub Kuszyński wykorzystuje cookies własne w celu:</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">uwierzytelniania Klienta w Sklepie Internetowym i zapewnienia sesji Klienta w Sklepie Internetowym (po zalogowaniu), dzięki której Klient nie musi na każdej podstronie Sklepu Internetowego ponownie wpisywać loginu i hasła;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">b)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">analiz i badań oraz audytu oglądalności, a w szczególności do tworzenia anonimowych statystyk, które pomagają zrozumieć, w jaki sposób Klienci korzystają ze Strony Internetowej Sklepu, co umożliwia ulepszanie jej struktury i zawartości.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">4.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Network Lab Jakub Kuszyński wykorzystuje cookies zewnętrzne w celu:</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">popularyzacji Sklepu Internetowego za pomocą serwisu społecznościowego facebook.com (administrator cookies zewnętrznego: Facebook Inc z siedzibą w USA lub Facebook Ireland z siedzibą w Irlandii);</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">b)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">zbierania ogólnych i anonimowych danych statycznych za pośrednictwem narzędzi analitycznych Google Analytics (administrator cookies zewnętrznego:  Google LLC z siedzibą w USA);</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">c)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">prezentacji Certyfikatu Rzetelny Regulamin za pośrednictwem serwisu internetowego rzetelnyregulamin.pl (administrator cookies zewnętrznego: Rzetelna Grupa sp. z o.o. z siedzibą w Warszawie).</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">5.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Mechanizm cookies jest bezpieczny dla komputerów Klientów Sklepu Internetowego. W szczególności tą drogą nie jest możliwe przedostanie się do komputerów Klientów wirusów lub innego niechcianego oprogramowania lub oprogramowania złośliwego. Niemniej w swoich przeglądarkach Klienci mają możliwość ograniczenia lub wyłączenia dostępu plików cookies do komputerów. W przypadku skorzystania z tej opcji korzystanie ze Sklepu Internetowego będzie możliwe, poza funkcjami, które ze swojej natury wymagają plików cookies.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">6.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Poniżej przedstawiamy, jak można zmienić ustawienia popularnych przeglądarek internetowych w zakresie stosowania plików cookies:</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">przeglądarka <a href=\"https://support.google.com/chrome/bin/answer.py?hl=pl&amp;answer=95647\" target=\"_blank\" rel=\"nofollow noreferrer noopener\" style=\"background-color:transparent;\">Chrome i Chrome Mobile</a>;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">b)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">przeglądarka <a href=\"https://www.facebook.com/policies/cookies\" target=\"_blank\" rel=\"nofollow noreferrer noopener\" style=\"background-color:transparent;\">Facebook in-app Browser</a>;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">c)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">przeglądarka <a href=\"https://support.microsoft.com/pl-pl/kb/278835\" target=\"_blank\" rel=\"nofollow noreferrer noopener\" style=\"background-color:transparent;\">Internet Explorer</a>;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">d)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">przeglądarka <a href=\"https://privacy.microsoft.com/pl-PL/windows-10-microsoft-edge-and-privacy\" target=\"_blank\" rel=\"nofollow noreferrer noopener\" style=\"background-color:transparent;\">Microsoft EDGE</a>;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">e)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">przeglądarka <a href=\"http://support.mozilla.org/pl/kb/ciasteczka\" target=\"_blank\" rel=\"nofollow noreferrer noopener\" style=\"background-color:transparent;\">Mozilla Firefox</a>;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">f)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">przeglądarka <a href=\"http://help.opera.com/Linux/9.22/pl/cookies.html\" target=\"_blank\" rel=\"nofollow noreferrer noopener\" style=\"background-color:transparent;\">Opera</a>;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">g)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">przeglądarka <a href=\"https://support.apple.com/pl-pl/HT201265\" target=\"_blank\" rel=\"nofollow noreferrer noopener\" style=\"background-color:transparent;\">Safari i Safari Mobile</a>;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">h)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">przeglądarka <a href=\"https://www.samsung.com/uk/support/mobile-devices/what-are-cookies-and-how-do-i-enable-or-disable-them-on-my-samsung-galaxy-device/\" target=\"_blank\" rel=\"nofollow noreferrer noopener\" style=\"background-color:transparent;\">Samsung Browser</a>.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">7.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Network Lab Jakub Kuszyński może gromadzić adresy IP Klientów. Adres IP to numer przydzielany komputerowi osoby odwiedzającej Sklep Internetowy przez dostawcę usług internetowych. Numer IP umożliwia dostęp do Internetu. W większości przypadków jest przypisywany komputerowi dynamicznie, tj. zmienia się przy każdym połączeniu z Internetem. Adres IP jest wykorzystywany przez Network Lab Jakub Kuszyński przy diagnozowaniu problemów technicznych z serwerem, tworzeniu analiz statystycznych (np. określeniu, z jakich regionów notujemy najwięcej odwiedzin), jako informacja przydatna przy administrowaniu i udoskonalaniu Sklepu Internetowego, a także w celach bezpieczeństwa oraz ewentualnej identyfikacji obciążających serwer, niepożądanych automatycznych programów do przeglądania treści Sklepu Internetowego.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">8.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Sklep Internetowy zawiera linki i odnośniki do innych stron internetowych. Network Lab Jakub Kuszyński nie ponosi odpowiedzialności za zasady ochrony prywatności na nich obowiązujące.</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"11\" style=\"vertical-align:top;margin:15px 0px;text-align:center;font-weight:bold;\"><span class=\"anchor\"></span>§ 4 Prawa osób, których dane dotyczą</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">1.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\"><span style=\"font-weight:bolder;\">Prawo do cofnięcia zgody</span> - podstawa prawna: art. 7 ust. 3 RODO.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">Klient ma prawo do cofnięcia każdej zgody, jakiej udzielił Network Lab Jakub Kuszyński.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">b)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">Cofnięcie zgody ma skutek od momentu wycofania zgody.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">c)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">Cofnięcie zgody nie wpływa na przetwarzanie dokonywane przez Network Lab Jakub Kuszyński zgodnie z prawem przed jej cofnięciem.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">d)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">Cofnięcie zgody nie pociąga za sobą dla Klienta żadnych negatywnych konsekwencji, może jednak uniemożliwić dalsze korzystanie z usług lub funkcjonalności, które zgodnie z prawem Network Lab Jakub Kuszyński może świadczyć jedynie za zgodą.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">2.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\"><span style=\"font-weight:bolder;\">Prawo do sprzeciwu wobec przetwarzania danych</span> - podstawa prawna: art. 21 RODO.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">Klient ma prawo w dowolnym momencie wnieść sprzeciw - z przyczyn związanych z jego szczególną sytuacją - wobec przetwarzania jego danych osobowych, w tym profilowania, jeżeli Network Lab Jakub Kuszyński przetwarza jego dane w oparciu o prawnie uzasadniony interes, np. marketing produktów i usług Network Lab Jakub Kuszyński, prowadzenie statystyki korzystania z poszczególnych funkcjonalności Sklepu Internetowego oraz ułatwienie korzystania ze Sklepu Internetowego, a także badanie satysfakcji.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">b)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">Rezygnacja w formie wiadomości e-mail z otrzymywania komunikatów marketingowych dotyczących produktów lub usług, będzie oznaczać sprzeciw Klienta na przetwarzanie jego danych osobowych, w tym profilowania w tych celach.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">c)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">Jeżeli sprzeciw Klienta okaże się zasadny i Network Lab Jakub Kuszyński nie będzie miał innej podstawy prawnej do przetwarzania danych osobowych, dane osobowe Klienta zostaną usunięte, wobec przetwarzania których, Klient wniósł sprzeciw.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">3.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\"><span style=\"font-weight:bolder;\">Prawo do usunięcia danych („prawo do bycia zapomnianym”)</span> - podstawa prawna: art. 17 RODO.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">Klient ma prawo do żądania usunięcia wszystkich lub niektórych danych osobowych.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">b)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">Klient ma prawo żądania usunięcia danych osobowych, jeżeli:</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"4\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a.</td>\r\n<td colspan=\"6\" style=\"vertical-align:top;\">dane osobowe nie są już niezbędne do celów, w których zostały zebrane lub w których były przetwarzane;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"4\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">b.</td>\r\n<td colspan=\"6\" style=\"vertical-align:top;\">wycofał określoną zgodę, w zakresie w jakim dane osobowe były przetwarzane w oparciu o jego zgodę;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"4\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">c.</td>\r\n<td colspan=\"6\" style=\"vertical-align:top;\">wniósł sprzeciw wobec wykorzystywania jego danych w celach marketingowych;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"4\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">d.</td>\r\n<td colspan=\"6\" style=\"vertical-align:top;\">dane osobowe są przetwarzane niezgodnie z prawem;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"4\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">e.</td>\r\n<td colspan=\"6\" style=\"vertical-align:top;\">dane osobowe muszą zostać usunięte w celu wywiązania się z obowiązku prawnego przewidzianego w prawie Unii lub prawie Państwa członkowskiego, któremu Network Lab Jakub Kuszyński podlega;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"4\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">f.</td>\r\n<td colspan=\"6\" style=\"vertical-align:top;\">dane osobowe zostały zebrane w związku z oferowaniem usług społeczeństwa informacyjnego.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">c)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">Pomimo żądania usunięcia danych osobowych, w związku z wniesieniem sprzeciwu lub wycofaniem zgody, Network Lab Jakub Kuszyński może zachować pewne dane osobowe w zakresie, w jakim przetwarzanie jest niezbędne do ustalenia, dochodzenia lub obrony roszczeń, jak również do wywiązania się z prawnego obowiązku wymagającego przetwarzania na mocy prawa Unii lub prawa państwa członkowskiego, któremu podlega Network Lab Jakub Kuszyński. Dotyczy to w szczególności danych osobowych obejmujących: imię, nazwisko, adres e-mail, które to dane zachowywane są dla celów rozpatrywania skarg oraz roszczeń związanych z korzystaniem z usług Network Lab Jakub Kuszyński, czy też dodatkowo adresu zamieszkania/adresu korespondencyjnego, numeru zamówienia, które to dane zachowywane są dla celów rozpatrywania skarg oraz roszczeń związanych z zawartymi umowami sprzedaży lub świadczeniem usług.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">4.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\"><span style=\"font-weight:bolder;\">Prawo do ograniczenia przetwarzania danych</span> - podstawa prawna: art. 18 RODO.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">Klient ma prawo do żądania ograniczenia przetwarzania jego danych osobowych. Zgłoszenie żądania, do czasu jego rozpatrzenia uniemożliwia korzystanie z określonych funkcjonalności lub usług, z których korzystanie będzie się wiązało z przetwarzaniem danych objętych żądaniem. Network Lab Jakub Kuszyński nie będzie też wysyłał żadnych komunikatów, w tym marketingowych.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">b)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">Klient ma prawo do żądania ograniczenia wykorzystania danych osobowych w następujących przypadkach:</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"4\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a.</td>\r\n<td colspan=\"6\" style=\"vertical-align:top;\">gdy kwestionuje prawidłowość swoich danych osobowych – wówczas Network Lab Jakub Kuszyński ogranicza ich wykorzystanie na czas potrzebny do sprawdzenia prawidłowości danych, nie dłużej jednak niż na 7 dni;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"4\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">b.</td>\r\n<td colspan=\"6\" style=\"vertical-align:top;\">gdy przetwarzanie danych jest niezgodne z prawem, a zamiast usunięcia danych Klient zażąda ograniczenia ich wykorzystania;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"4\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">c.</td>\r\n<td colspan=\"6\" style=\"vertical-align:top;\">gdy dane osobowe przestały być niezbędne do celów, w których zostały zebrane lub wykorzystywane ale są one potrzebne Klientowi w celu ustalenia, dochodzenia lub obrony roszczeń;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"4\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">d.</td>\r\n<td colspan=\"6\" style=\"vertical-align:top;\">gdy wniósł sprzeciw wobec wykorzystania jego danych – wówczas ograniczenie następuje na czas potrzebny do rozważenia, czy – ze względu na szczególną sytuację – ochrona interesów, praw i wolności Klienta przeważa nad interesami, które realizuje Administrator, przetwarzając dane osobowe Klienta.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">5.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\"><span style=\"font-weight:bolder;\">Prawo dostępu do danych</span> - podstawa prawna: art. 15 RODO.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">Klient ma prawo uzyskać od Administratora potwierdzenie, czy przetwarza dane osobowe, a jeżeli ma to miejsce, Klient ma prawo:</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"4\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a.</td>\r\n<td colspan=\"6\" style=\"vertical-align:top;\">uzyskać dostęp do swoich danych osobowych;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"4\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">b.</td>\r\n<td colspan=\"6\" style=\"vertical-align:top;\">uzyskać informacje o celach przetwarzania, kategoriach przetwarzanych danych osobowych, o odbiorcach lub kategoriach odbiorców tych danych, planowanym okresie przechowywania danych Klienta albo o kryteriach ustalania tego okresu (gdy określenie planowanego okresu przetwarzania danych nie jest możliwe), o prawach przysługujących Klientowi na mocy RODO oraz o prawie wniesienia skargi do organu nadzorczego, o źródle tych danych, o zautomatyzowanym podejmowaniu decyzji, w tym o profilowaniu oraz o zabezpieczeniach stosowanych w związku z przekazaniem tych danych poza Unię Europejską;</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"4\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">c.</td>\r\n<td colspan=\"6\" style=\"vertical-align:top;\">uzyskać kopię swoich danych osobowych.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">6.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\"><span style=\"font-weight:bolder;\">Prawo do sprostowania danych</span> - podstawa prawna: art. 16 RODO.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">Klient ma prawo do żądania od Administratora niezwłocznego sprostowania dotyczących jego danych osobowych, które są nieprawidłowe. Z uwzględnieniem celów przetwarzania, Klient, którego dane dotyczą ma prawo żądania uzupełnienia niekompletnych danych osobowych, w tym przez przedstawienie dodatkowego oświadczenia, kierując prośbę na adres poczty elektronicznej zgodnie z §6 Polityki Prywatności.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">7.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\"><span style=\"font-weight:bolder;\">Prawo do przenoszenia danych</span> - podstawa prawna: art. 20 RODO.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"3\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">a)</td>\r\n<td colspan=\"7\" style=\"vertical-align:top;\">Klient ma prawo otrzymać swoje dane osobowe, które dostarczył Administratorowi, a następnie przesłać je do innego, wybranego przez siebie, administratora danych osobowych. Klient ma również prawo żądać, by dane osobowe zostały przesłane przez Administratora bezpośrednio takiemu administratorowi, o ile jest to technicznie możliwe. W takim przypadku Administrator prześle dane osobowe Klienta w postaci pliku w formacie csv, który jest formatem powszechnie używanym, nadającym się do odczytu maszynowego i pozwalającym na przesłanie otrzymanych danych do innego administratora danych osobowych.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">8.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">W sytuacji wystąpienia przez Klienta z uprawnieniem wynikającym z powyższych praw, Network Lab Jakub Kuszyński spełnia żądanie albo odmawia jego spełnienia niezwłocznie, nie później jednak niż w ciągu miesiąca po jego otrzymaniu. Jeżeli jednak - z uwagi na skomplikowany charakter żądania lub liczbę żądań – Network Lab Jakub Kuszyński nie będzie mógł spełnić żądania w ciągu miesiąca, spełni je w ciągu kolejnych dwóch miesięcy informując Klienta uprzednio w terminie miesiąca od otrzymania żądania - o zamierzonym przedłużeniu terminu oraz jego przyczynach.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">9.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Klient może zgłaszać do Administratora skargi, zapytania i wnioski dotyczące przetwarzania jego danych osobowych oraz realizacji przysługujących mu uprawnień.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">10.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Klient ma prawo żądać od Network Lab Jakub Kuszyński przekazania kopii standardowych klauzul umownych kierując zapytanie w sposób wskazany w §6 Polityki Prywatności.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">11.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Klientowi przysługuje prawo do wniesienia skargi do Prezesa Urzędu Ochrony Danych Osobowych, w zakresie naruszenia jego praw do ochrony danych osobowych lub innych praw przyznanych na mocy RODO.</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"11\" style=\"vertical-align:top;margin:15px 0px;text-align:center;font-weight:bold;\"><span class=\"anchor\"></span>§ 5 Zarządzanie bezpieczeństwem - hasło</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">1.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Network Lab Jakub Kuszyński zapewnia Klientom bezpieczne i szyfrowane połączenie podczas przesyłania danych osobowych oraz podczas logowania się do Konta Klienta w Serwisie. Network Lab Jakub Kuszyński stosuje certyfikat SSL wystawiony przez jedną z czołowych światowych firm w zakresie bezpieczeństwa i szyfrowania przesyłanych danych przez sieć Internet.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">2.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">W przypadku gdy Klient posiadający konto w Sklepie Internetowym utracił w jakikolwiek sposób hasło dostępu, Sklep Internetowy umożliwia wygenerowanie nowego hasła. Network Lab Jakub Kuszyński nie wysyła przypomnienia hasła. Hasło jest przechowywane w formie zaszyfrowanej, w sposób uniemożliwiający jego odczytanie. Celem wygenerowania nowego hasła należy podać adres e-mail w formularzu dostępnym pod linkiem „Nie pamiętasz hasła”, podanym przy formularzu logowania do konta w Sklepie Internetowym. Klient na adres poczty elektronicznej podany podczas rejestracji lub zapisany w ostatniej zmianie profilu konta otrzyma wiadomość elektroniczną zawierającą przekierowanie do dedykowanego formularza udostępnionego na Stronie Internetowej Sklepu, gdzie Klient będzie miał możliwość ustalenia nowego hasła.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">3.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Network Lab Jakub Kuszyński nigdy nie wysyła żadnej korespondencji, w tym korespondencji elektronicznej z prośbą o podanie danych do logowania, a w szczególności hasła dostępowego do konta Klienta.</td>\r\n</tr>\r\n<tr>\r\n<td colspan=\"11\" style=\"vertical-align:top;margin:15px 0px;text-align:center;font-weight:bold;\"><span class=\"anchor\"></span>§ 6 Zmiany Polityki Prywatności</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">1.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Polityka Prywatności może ulec zmianie, o czym Network Lab Jakub Kuszyński poinformuje Klientów z wyprzedzeniem 7 dni.</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">2.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Pytania związane z Polityką Prywatności prosimy kierować na adres: kontakt@monsteriada.pl</td>\r\n</tr>\r\n<tr class=\"dokument-linia\">\r\n<td colspan=\"2\"> </td>\r\n<td nowrap=\"nowrap\" style=\"vertical-align:top;width:30pt;\">3.</td>\r\n<td colspan=\"8\" style=\"vertical-align:top;\">Data ostatniej modyfikacji: 08.04.2023 r.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n','polityka-prywatnosci'),(4,1,1,'Dostawa i koszty wysyłki','','','','<h1 style=\"font-size:36px;margin:0px;font-family:inherit;font-weight:bold;line-height:1.1;padding:0px 0px 30px;text-transform:none;\">Dostawa i koszty wysyłki</h1>\r\n\r\n<h1 style=\"font-size:1.375rem;margin:0px 0px 0.5rem;font-family:inherit;line-height:1.1;color:inherit;\">Dostawa i koszty wysyłki</h1>\r\n\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\">Poniżej prezentujemy Państwu koszty wysyłki w naszym sklepie internetowym.</p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\">Koszty przesyłki zależne są od wybranego przy finalizacji transakcji sposobu dostarczenia do Państwa zakupionych towarów i wynoszą:</p>\r\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style-position:inside;list-style-image:none;padding-left:0px;font-size:0.9375rem;color:#7a7a7a;\">\r\n<li>przy wybraniu opcji <span style=\"font-weight:bolder;\">PRZESYŁKA KURIERSKA / PRZEDPŁATA</span> - <span style=\"font-weight:bolder;\">14,5 zł</span> /paczki są wysyłane następnego dnia roboczego po zaksięgowaniu przelewu lub otrzymania potwierdzenia z serwisu payu.pl o dokonaniu płatności/ (chyba że w trakcie składania zamówienia został wskazany dłuższy termin realizacji).</li>\r\n<li>przy wybraniu opcji <span style=\"font-weight:bolder;\">PRZESYŁKA KURIERSKA / POBRANIE</span> - <span style=\"font-weight:bolder;\">18 zł</span> /paczki są wysyłane następnego dnia roboczego po otrzymaniu informacji na temat wyboru przesyłki pobraniowej (chyba że w trakcie składania zamówienia został wskazany dłuższy termin realizacji). Płatność regulowana jest dostawcy przy odbiorze przesyłki</li>\r\n<li>przy wybraniu opcji <span style=\"font-weight:bolder;\">PACZKOMATY / PRZEDPŁATA</span> - <span style=\"font-weight:bolder;\">12</span><span style=\"font-weight:bolder;\"> zł</span> /paczki są wysyłane następnego dnia roboczego po zaksięgowaniu przelewu lub otrzymania potwierdzenia z serwisu payu.pl o dokonaniu płatności/ (chyba że w trakcie składania zamówienia został wskazany dłuższy termin realizacji).</li>\r\n<li>przy wybraniu opcji <span style=\"font-weight:bolder;\">PACZKOMATY / POBRANIE</span> - <span style=\"font-weight:bolder;\">15 zł</span> /paczki są wysyłane następnego dnia roboczego po otrzymaniu informacji na temat wyboru przesyłki pobraniowej (chyba że w trakcie składania zamówienia został wskazany dłuższy termin realizacji). Płatność regulowana jest dostawcy przy odbiorze przesyłki.</li>\r\n<li>przy wybraniu opcji <span style=\"font-weight:bolder;\">ODBIÓR OSOBISTY</span> - <span style=\"font-weight:bolder;\">0 zł</span> / zakupione towary można odebrać osobiście z magazynu firmy po wcześniejszym ustaleniu terminu odbioru. Możliwość płatności gotówką przy odbiorze towaru/.</li>\r\n</ul>\r\n','dostawa'),(5,1,1,'Akceptowane płatności','','','','<h1 style=\"font-size:36px;margin:0px;font-family:inherit;font-weight:bold;line-height:1.1;padding:0px 0px 30px;text-transform:none;\">Akceptowane płatności</h1>\r\n\r\n<h2 style=\"margin-top:0px;margin-bottom:0.5rem;font-family:inherit;line-height:1.1;color:inherit;font-size:1.25rem;\">Tekst płatności</h2>\r\n\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\">W sklepie internetowym monsteriada.pl akceptowane są następujące rodzaje płatności:<br /><br /><br /></p>\r\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style-position:inside;list-style-image:none;padding-left:0px;font-size:0.9375rem;color:#7a7a7a;\">\r\n<li><span style=\"font-size:small;\"><span style=\"font-weight:bolder;\">gotówką przy odbiorze osobistym</span><br /><br /></span></li>\r\n</ul>\r\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style-position:inside;list-style-image:none;padding-left:0px;font-size:0.9375rem;color:#7a7a7a;\">\r\n<li><span style=\"font-size:small;\"><span style=\"font-weight:bolder;\"><span>przelew na konto bankowe</span></span><br /></span></li>\r\n</ul>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;padding-left:60px;text-align:center;\"><span style=\"font-size:small;\">Przelewy prosimy kierować na:</span></p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;padding-left:60px;text-align:center;\"><span style=\"font-size:small;\">NETWORK LAB Jakub Kuszyński<br />Garwolińska 9/95<br />04-348 Warszawa</span></p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;padding-left:60px;text-align:center;\"><span style=\"font-size:small;\"><br /><img src=\"https://photos05.redcart.pl/templates/images/description/767/Image/infostrony/alior_bank_logo.png\" alt=\"Logo Alior Bank\" title=\"Logo Alior Bank\" width=\"107\" height=\"55\" style=\"border-style:none;vertical-align:middle;\" /></span></p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;padding-left:60px;text-align:center;\"><span style=\"font-weight:bolder;\"><span style=\"font-size:small;\"><span style=\"font-size:medium;\">27 2490 0005 0000 4530 4511 8564</span><br /><br /></span></span></p>\r\n<ul style=\"margin-bottom:1rem;margin-top:0px;list-style-position:inside;list-style-image:none;padding-left:0px;font-size:0.9375rem;color:#7a7a7a;\">\r\n<li><span style=\"font-size:small;\"><span style=\"font-weight:bolder;\">szybkie i bezpieczne przelewy oraz płatności kartami kredytowymi za pośrednictwem serwisu PayU.pl</span><br /><br /></span></li>\r\n</ul>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;text-align:center;\"><span style=\"font-size:small;\"><span style=\"white-space:pre;\"> <img src=\"https://photos05.redcart.pl/templates/images/description/767/Image/infostrony/PAYU_LOGO_SOLID_LIME_RGB.jpg\" alt=\"Logo PayU\" title=\"Logo PayU\" width=\"250\" height=\"132\" style=\"border-style:none;vertical-align:middle;\" /></span></span></p>\r\n','platnosci'),(6,1,1,'Zwroty i reklamacje','','','','<h1 style=\"font-size:36px;margin:0px;font-family:inherit;font-weight:bold;line-height:1.1;padding:0px 0px 30px;text-transform:none;\">Zwroty i reklamacje</h1>\r\n\r\n<h1 style=\"font-size:1.375rem;margin:0px 0px 0.5rem;font-family:inherit;line-height:1.1;color:inherit;\">Zwroty i reklamacje</h1>\r\n\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\">Dziękujemy za zakupy w naszym sklepie! Jesteśmy przekonani, że zakupione przez Ciebie produkty spełnią Twoje oczekiwania. Jesteśmy tutaj po to, aby Ci pomóc i zapewnić Ci satysfakcję z zakupów. Jeśli mimo wszystko masz jakiekolwiek problemy z otrzymanym produktem, zachęcamy Cię do pierwotnego skontaktowania się z nami. Dzięki temu będziemy w stanie udzielić Ci wsparcia, poradzić i razem rozwiążemy ewentualny problem.</p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\"></p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\"></p>\r\n\r\n<h2 style=\"margin-top:0px;margin-bottom:0.5rem;font-family:inherit;line-height:1.1;color:inherit;font-size:1.25rem;\">Reklamacje</h2>\r\n\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\">Jeśli z jakiegoś powodu produkt nie spełnia Twoich oczekiwań lub jest uszkodzony, masz prawo złożyć reklamację. Aby to zrobić, postępuj zgodnie z poniższymi krokami:</p>\r\n<ol style=\"margin-bottom:1rem;margin-top:0px;\">\r\n<li>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\"><span>Skontaktuj się z nami:</span> Jeśli zauważysz problem z produktem, skontaktuj się z naszym zespołem obsługi klienta jak najszybciej po otrzymaniu przesyłki. Możesz skorzystać z naszych danych kontaktowych podanych na stronie \"<a href=\"https://monsteriada.pl/kontakt\" style=\"background-color:transparent;\">Kontakt</a>\" lub skorzystać z dostępnych formularzy kontaktowych na naszej stronie internetowej.</p>\r\n</li>\r\n<li>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\"><span>Opisz problem:</span> W e-mailu lub wiadomości do naszego zespołu reklamacji, dokładnie opisz problem z produktem. Im więcej informacji podasz, tym szybciej będziemy w stanie Ci pomóc. Zdjęcia również mile widziane :)</p>\r\n</li>\r\n<li>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\"><span>Odesłanie produktu:</span> Jeśli nasz zespół reklamacji uzna, że odesłanie produktu jest konieczne, poinformujemy Cię o dalszych krokach. Upewnij się, że produkt jest odpowiednio zabezpieczony przed uszkodzeniami podczas transportu.</p>\r\n</li>\r\n<li>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\"><span>Przetwarzanie reklamacji:</span> Po otrzymaniu reklamowanego produktu, nasz zespół dokładnie przeanalizuje zgłoszony problem. Postaramy się rozpatrzyć Twoją reklamację w możliwie najkrótszym czasie i zaproponować odpowiednie rozwiązanie.</p>\r\n</li>\r\n</ol>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\"></p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\"></p>\r\n\r\n<h2 style=\"margin-top:0px;margin-bottom:0.5rem;font-family:inherit;line-height:1.1;color:inherit;font-size:1.25rem;\">Zwroty konsumenckie (odstąpienie od umowy)<span style=\"font-weight:bolder;\"><br /></span></h2>\r\n\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\">Jesteśmy przekonani, że będziesz zadowolony z zakupów w naszym sklepie. Niemniej jednak, zgodnie z przepisami prawa konsumenckiego, przysługuje Ci prawo do odstąpienia od umowy w ciągu 14 dni od otrzymania przesyłki bez podania przyczyny. Jeśli zdecydujesz się na zwrot, postępuj zgodnie z poniższymi krokami:</p>\r\n<ol style=\"margin-bottom:1rem;margin-top:0px;\">\r\n<li>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\"><span>Powiadom nas:</span> Jeśli chcesz zwrócić zakupiony produkt, skontaktuj się z naszym zespołem obsługi klienta, informując nas o swojej decyzji. Możesz również skorzystać z formularza zwrotu dostępnego na naszej stronie internetowej.</p>\r\n</li>\r\n<li>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\"><span>Odeślij produkt:</span> Odeślij produkt w oryginalnym opakowaniu, w stanie nienaruszonym i bez śladów użytkowania. Koszt zwrotu ponosi Klient. Dane do odesłania produktu znajdują się poniżej. Dodatkowo, udostępniamy naszym Klientom możliwość skorzystania z WygodneZwroty.pl - instrukcja również poniżej.</p>\r\n</li>\r\n<li>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\"><span>Przetwarzanie zwrotu:</span> Po otrzymaniu zwróconego produktu i weryfikacji produktu przechodzimy do przetworzenia i dokonujemy zwrot płatności za produkt.</p>\r\n</li>\r\n</ol>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\"></p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\"></p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\">Jesteśmy tutaj, aby uczynić proces reklamacji lub zwrotu jak najbardziej prostym i elastycznym. Jeśli masz jakiekolwiek pytania lub wątpliwości, nie wahaj się skontaktować z naszym zespołem obsługi klienta. Dziękujemy za zaufanie i wybór naszego sklepu!</p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\"></p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\"><span>Zwrotu produktu należy dokonać na adres:</span></p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\">Network Lab Jakub Kuszyński<br />ul. Dolna 26/28 lok 23<br />00-774 Warszawa<br />tel.: 503 028 506</p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\"><br /><span>Można również odesłać paczkomatem:</span><br />Nr paczkomatu: WAW468M<br />Nr tel.: 503028506<br />Adres email.: biuro@networklab.pl</p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\"></p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\"><span>Naszym Klientom udostępniamy również możliwość skorzystania z \"Wygodne Zwroty\"</span></p>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\"></p>\r\n<div id=\"ak_returns_banner_ff5dfae5-0102-4eba-8f66-142d2e28eb2d\"></div>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\">Wygodne Zwroty nie jest formą darmowego odesłania produktu - takiej w naszym sklepie nie oferujemy. Jest to możliwość szybszego i łatwiejszego odesłania produktu w momencie skorzystania z prawa do odstąpienia od umowy. Jednakże koszt odesłania produktu, zgodnie z przepisami, pokrywa Kupujący.</p>\r\n','zwroty-i-reklamacje'),(7,1,1,'Jak złożyć zamówienie','','','','<h1 style=\"font-size:36px;margin:0px;font-family:inherit;line-height:1.1;padding:0px 0px 30px;\">Jak złożyć zamówienie</h1>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\">Tekst jak złożyć zamówienie</p>','jak-zlozyc-zamowienie'),(8,1,1,'Zapraszamy do współpracy','','','','<h1 style=\"font-size:36px;margin:0px;font-family:inherit;line-height:1.1;padding:0px 0px 30px;\">Zapraszamy do współpracy</h1>\r\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\">Tekst w przygotowaniu</p>','zapraszamy-do-wspolpracy'),(9,1,1,'Jak złożyć zamówienie','','','','<h1 style=\"font-size:36px;margin:0px;font-family:inherit;font-weight:bold;line-height:1.1;padding:0px 0px 30px;text-transform:none;\">Jak złożyć zamówienie</h1>','jak-zlozyc-zamowienie'),(10,1,1,'Prezent na każdą okazję','','','','<h1 style=\"font-size:36px;margin:0px;font-family:inherit;font-weight:bold;line-height:1.1;padding:0px 0px 30px;text-transform:none;\">Prezent na każdą okazję</h1>\n<p style=\"margin-top:0px;margin-bottom:16px;line-height:30px;\">Coś tutaj będzie</p>','prezent-na-kazda-okazje');
